INSERT INTO `contents` VALUES ('1', 'Nhà Thích Quảng Đức - Phùng Văn Cung, DT: 41,1m2, Giá: 5.4,1 tỷ P 7,PN', '5 tỷ 410 triệu', '[\"9cd84c58fbcc4952a964a7518bdb3123.jpg\",\"5cc924f34c8b4b8895d6b64c4aa0ab93.jpg\"]', ' Phùng Văn Cung, Phường 7, Quận Phú Nhuận, TP.HCM', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 5 tỷ 410 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 41,1 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: 41,1 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2380032&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: 5&lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: 5&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ hồng&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Đ&ocirc;ng&lt;/li&gt; &lt;/ul&gt; ', 'Một ng&ocirc;i nh&agrave; cực đẹp, vị tr&iacute; đắt địa.&lt;br /&gt;Chỉ duy nhất khu vực Ph&ugrave;ng Văn Cung.&lt;br /&gt;Hẻm lớn oto v&agrave;o tận nh&agrave;.&lt;br /&gt;Gi&aacute; 5,41 tỷ c&ograve;n thương lượng.&lt;br /&gt;Nh&agrave; 5 ph&ograve;ng ngủ Khu vực, gần chợ, trường trạm.&lt;br /&gt;Nh&agrave; 5 lầu x&acirc;y mới cực đẹp.&lt;br /&gt;Ngang: 3,5m&lt;br /&gt;D&agrave;i: 13,1m.&lt;br /&gt;Nh&igrave;n v&ocirc; l&agrave; th&iacute;ch ngay.&lt;br /&gt;T&ocirc;i sẽ hỗ trợ bạn để thương lượng v&agrave; c&oacute; gi&aacute; tốt nhất, b&ecirc;n mua ho&agrave;n to&agrave;n kh&ocirc;ng mất ph&iacute;, được tư vấn hỗ trợ ph&aacute;p l&yacute;, hợp đồng 24/24.&amp;#160;&lt;br /&gt;Ch&uacute;ng t&ocirc;i hiện đang sở hữu kho dữ liệu nh&agrave; đất thổ cư lớn nhất TP HCM với mọi mức gi&aacute; v&agrave; được cập nhật li&ecirc;n tục. Qu&yacute; kh&aacute;ch quan t&acirc;m, vui l&ograve;ng li&ecirc;n hệ: Đ&ecirc;m BĐS (miễn trung gian).', '68', null);
INSERT INTO `contents` VALUES ('2', 'Bán gấp nhà Lý Thường Kiệt, P9, TB. DT: 3.5x22m, 3 lầu, giá 7.5 Tỷ', '7 tỷ 500 triệu', '[\"019a4447bc6e418a9ca8bc1bf9d5e66c.jpg\"]', ' Lý Thường Kiệt, Phường 9, Quận Tân Bình, TP.HCM', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 7 tỷ 500 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: 70 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2382221&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: 5&lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: 5&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ hồng&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', '&amp;quot;B&aacute;n gấp nh&agrave; L&yacute; Thường Kiệt, P9, Q.T&acirc;n B&igrave;nh.&lt;br /&gt;DT: 3.5x22m, đ&uacute;c 3 lầu.&lt;br /&gt;Hẻm trước 8m sạch sẽ, hẻm sau 2m th&ocirc;ng tho&aacute;ng, kh&ocirc;ng d&iacute;nh cống cột, th&ocirc;ng L&yacute; Thường Kiệt, Thi&ecirc;n Phước, xung quanh c&oacute; c&oacute; trường học c&aacute;c cấp như Nguyễn Gia Thiều, Nguyễn Th&aacute;i B&igrave;nh, chợ &ocirc;ng Ho&agrave;ng, gần cv T&acirc;n Phước, gần nh&agrave; thờ n&ecirc;n th&iacute;ch hợp cho ai theo đạo, vị tr&iacute; c&oacute; đầy đủ tiện &iacute;ch ăn uống, dịch vụ, ng&acirc;n h&agrave;ng. khu trung t&acirc;m n&ecirc;n thuận tiện di chuyển Q.11, Q.10 v&agrave; c&aacute;c quận l&acirc;n cận.&lt;br /&gt;Khu vực d&acirc;n tr&iacute; cao, hẻm c&oacute; lắp camera an ninh, th&iacute;ch hợp định cư l&acirc;u d&agrave;i, l&agrave;m văn ph&ograve;ng hoặc cho thu&ecirc; gi&aacute; cao.&lt;br /&gt;Gi&aacute; b&aacute;n 7.5 Tỷ. &lt;br /&gt;Nh&agrave; đẹp , gi&aacute; tốt. Mong gặp kh&aacute;ch thiện ch&iacute;, c&oacute; nhu cầu thật sự. MG miễn l&agrave;m phiền.&lt;br /&gt;LH: 0902818375 Đo&agrave;n Bảo&amp;quot;', '70', null);
INSERT INTO `contents` VALUES ('3', 'Bán đất Đường Bình Trưng, Quận 2, sổ đỏ, thổ cư 100%', '795 triệu', '[\"b1e9525f17154427b2590679a0a1c480.jpg\"]', ' Bình Trưng, Phường Bình Trưng Đông, Quận 2, TP.HCM', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 795 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 100 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: 100 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2190469&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ đỏ&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Bắc&lt;/li&gt; &lt;/ul&gt; ', 'C&acirc;̀n bán g&acirc;́p l&ocirc; đ&acirc;́t th&ocirc;̉ cư 100m2.&lt;br /&gt;Ngay mặt ti&ecirc;̀n đường Bình Trưng, phường Bình Trưng Đ&ocirc;ng, Qu&acirc;̣n 2&lt;br /&gt;th&ocirc;̉ cư và x&acirc;y dựng tự do 100%. &lt;br /&gt;Nằm trong khu vực d&acirc;n cư đ&ocirc;ng đúc, ti&ecirc;̣n kinh doanh.&lt;br /&gt;Cách chợ, trường học trong bán kính 2km, cạnh trung t&acirc;m thương mại.&lt;br /&gt;Pháp lý đ&acirc;̀y đủ, thanh toán c&ocirc;ng chứng sang t&ecirc;n li&ecirc;̀n!!!&lt;br /&gt;Li&ecirc;n h&ecirc;̣: Mr.Tu&acirc;́n&lt;br /&gt;### mi&ecirc;̃n ti&ecirc;́p m&ocirc;i giới!', '71', null);
INSERT INTO `contents` VALUES ('4', 'Bán nhà mới đẹp mặt tiền ĐS-Tên Lửa,DT 4x20m, giá 5.2 tỷ', '5 tỷ 200 triệu', '[\"393a162b1c454f1cbbe1cd8a623d4bbd.jpg\",\"0350635702794c9c92677417a944489a.jpg\",\"388dd445f6e9404f853a14c3b96b962d.jpg\",\"e8a7d11bf53546c9a2ee08cc67020fd0.jpg\"]', ' Tên Lửa, Phường Bình Trị Đông, Quận Bình Tân, TP.HCM', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 5 tỷ 200 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: 81,1 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2390614&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: 5&lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: 5&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ hồng&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', 'B&aacute;n nh&agrave; mặt tiền ĐS-T&ecirc;n Lửa,DT 4x20m với thiết kế ho&agrave;n to&agrave;n kiểu phương t&acirc;y bởi kiến tr&uacute;c sư c&oacute; tiếng. Nh&agrave; đ&uacute;c 4 tấm &eacute;p cọc ki&ecirc;n cố gồm 1 trệt 3 lầu mới đẹp với đường n&eacute;t hoa văn tinh tế v&agrave; hiện đại.C&oacute; 5PN, 5WC,1 PK, 1 bếp,1 ph&ograve;ng thờ, ph&ograve;ng ăn,1 ph&ograve;ng giải tr&iacute;,ph&ograve;ng giặc phơi,s&acirc;n đậu xe hơi,s&acirc;n thượng ban c&ocirc;ng rộng r&atilde;i tho&aacute;ng m&aacute;t.Nội thất sang trọng v&agrave; tiện nghi,tủ lạnh 2 cửa k&iacute;nh chống lực, m&aacute;y điều h&ograve;a,m&aacute;y nước n&oacute;ng,quạt,tranh sơn dầu,tủ gỗ &acirc;m tường,bồn tắm sứ cao cấp,cầu thang đ&uacute;c đ&aacute; hoa cương, trang tr&iacute; hồ c&aacute; đẹp sang trọng,cửa 3 lớp an to&agrave;n&amp;#8230;tất cả đều sẵn s&agrave;ng, v&agrave;o ở ngay. Đường nhựa rộng 12m,khu an ninh,sầm uất nhất quận b&igrave;nh t&acirc;n,nhiều biệt thự, gần ngay si&ecirc;u thị Aeon Mall b&igrave;nh t&acirc;n,chợ,bệnh viện quốc tế,xe cộ qua lại đ&ocirc;ng đ&uacute;c&amp;#8230; tiện kinh doanh,mở văn ph&ograve;ng,c&ocirc;ng ty&amp;#8230;&lt;br /&gt;Gi&aacute; tốt: 5.2 tỷ (TL) Sổ hồng ch&iacute;nh chủ, bao sang t&ecirc;n,thanh to&aacute;n linh hoạt hỗ trợ vay vốn ng&acirc;n h&agrave;ng 70% gi&aacute; trị nh&agrave;.Li&ecirc;n hệ ngay để xem nh&agrave; miễn ph&iacute; A T&ugrave;ng 0939 530 580, miễn trung gian!', '72', null);
