;nh chủ&lt;br /&gt;-Gi&aacute; 7,2 tỷ TL&lt;br /&gt;-Li&ecirc;n hệ:Xu&acirc;n Ho&agrave;ng 0902.705.333 MTG', '73', null);
INSERT INTO `contents` VALUES ('6', 'Định cư Canada sang 315m2 đất thổ mặt tiền nhựa 16m ngay ql 13_420 tr', '420 triệu', '[\"80fc3cf60b134c708c18e119557c98f5.jpg\",\"f047c4cb72e046db8ee2180977840920.jpg\"]', ' Huỳnh Văn Lũy, Phường Phú Lợi, Thị Xã Thủ Dầu Một, Bình Dương', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 420 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: 315 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2359728&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ hồng&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', 'Định cư Canada n&ecirc;n sang gấp l&ocirc; đất 315m2 (10,5x30) thổ cư to&agrave;n bộ , sổ hồng năm 2011 , kẹt tiền nay sang gấp gi&aacute; 420 triệu. MT đường nhựa 16m gần qlộ 13, c&aacute;ch TPHCM 40 ph&uacute;t. Đất ở thị x&atilde; TD1_ B&igrave;nh Dương, d&acirc;n cư sầm uất, kế chợ, trường học v&agrave; cụm KCN lớn, tiện bu&ocirc;n b&aacute;n hoặc cho thu&ecirc;.X&acirc;y dựng tự do. L.hệ: Chị V&acirc;n 0906 707 129&lt;br /&gt;&lt;br /&gt;H&igrave;nh ảnh thực tế l&ocirc; đất', '74', null);
INSERT INTO `contents` VALUES ('7', 'Bán đất nền thổ cư 100% tại Khu đô thị mới Bình Dương', '245 triệu', '[\"793016eb4c804a00a0f7d78f35ef15a5.jpg\"]', ' Đại Lộ Bình Dương, Thành phố thủ Dầu Một, Bình Dương', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 245 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 300 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: 300 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2388425&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Giấy tờ hợp lệ&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', 'To&agrave;n bộ sản phẩm dưới đ&acirc;y đều do ng&acirc;n h&agrave;ng thanh l&yacute; thu hồi vốn - Hỗ trợ vay ng&acirc;n h&agrave;ng l&ecirc;n đến 70% (t&ugrave;y v&agrave;o thu nhập h&agrave;ng th&aacute;ng của kh&aacute;ch h&agrave;ng)&lt;br /&gt;&lt;br /&gt;Li&ecirc;n hệ ph&ograve;ng kinh doanh: 0964.300.369 gặp A. Ph&aacute;t&lt;br /&gt;&lt;br /&gt;Đất nền tại Khu đ&ocirc; thị Mỹ phước 3 (thổ cư 100%)&lt;br /&gt;&lt;br /&gt;100m2 (5x20m): 280 triệu&lt;br /&gt;&lt;br /&gt;150m2 (5x30m): 420 triệu&lt;br /&gt;&lt;br /&gt;300m2 (10x30m): 850 triệu&lt;br /&gt;&lt;br /&gt;450m2 (15x30m) : 1.2 tỷ&lt;br /&gt;&lt;br /&gt;L&ocirc; g&oacute;c 2 mặt tiền : 300m2 gi&aacute; 1 tỷ&lt;br /&gt;&lt;br /&gt;Tiện &iacute;ch Khu đ&ocirc; thị Mỹ phước 3:&lt;br /&gt;&lt;br /&gt;- Cơ sở hạ tầng ho&agrave;n thiện, c&aacute;c loại đường trong Khu đ&ocirc; thị (16m, 25m, 35m, 64m), vỉa h&egrave; 4m mỗi b&ecirc;n, cống r&atilde;nh đầy đủ, d&acirc;n cư đ&ocirc;ng đ&uacute;c, điện, nước, internet đầy đủ&lt;br /&gt;&lt;br /&gt;- Trong b&aacute;n k&iacute;nh 1km đầy đủ c&aacute;c tiện &iacute;ch: 3 chợ đ&atilde; hoạt động, 1 si&ecirc;u thị đang khởi c&ocirc;ng x&acirc;y, 3 ng&acirc;n h&agrave;ng, 15 nh&agrave; trẻ, 3 trường học (cấp 1,2,3), 2 trường Đại học đang x&acirc;y dựng (Đại học Việt đức, Đh Thủ dầu một) 1 trung t&acirc;m h&agrave;nh ch&iacute;nh, 1 khu thương mại dịch vụ, 2 ph&ograve;ng kh&aacute;m v&agrave; 1 bệnh viện.&lt;br /&gt;&lt;br /&gt;Li&ecirc;n hệ ph&ograve;ng kinh doanh: 0964.300.369 gặp A. Ph&aacute;t', '75', null);
