INSERT INTO `contents` VALUES ('10', 'Nhà mới hẻm ô tô Mã Lò (4.25x17m, 3 tấm đúc thật)', '3 tỷ 610 triệu', '[\"a72b748863114846954a15c62f967977.jpg\",\"9a9dfc8207c24daf94575f3cb5d800f4.jpg\"]', ' Mã Lò, Phường Bình Trị Đông A, Quận Bình Tân, TP.HCM', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 3 tỷ 610 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: 72 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2387429&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: 5&lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: 4&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ hồng&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', 'Chuyển c&ocirc;ng t&aacute;c xa cần b&aacute;n căn nh&agrave; mới x&acirc;y, hẻm 7-8m xe hơi v&agrave;o thoải m&aacute;i, c&oacute; s&acirc;n đậu xe hơi, đường M&atilde; L&ograve;, hẻm th&ocirc;ng, P.B&igrave;nh Trị Đ&ocirc;ng A, quận b&igrave;nh t&acirc;n.&lt;br /&gt;Diện t&iacute;ch 4.25x17m, c&ocirc;ng nhận đủ, x&acirc;y đủ diện t&iacute;ch, kh&ocirc;ng bị lộ giới, đ&uacute;c 3 tấm, nh&agrave; x&acirc;y dựng đẹp, ki&ecirc;n cố.&lt;br /&gt;Nh&agrave; gồm 1 trệt 2 lầu 1 s&acirc;n thượng: 1PK, 4PN, Bếp, Toilet mỗi ph&ograve;ng, 1 ph&ograve;ng thờ, ph&ograve;ng giải tr&iacute;, ban c&ocirc;ng rộng tiện giặc phơi trồng c&acirc;y xanh, hoa quả, giếng trời th&ocirc;ng tho&aacute;ng,s&acirc;n thượng tho&aacute;ng m&aacute;t rộng r&atilde;i.&lt;br /&gt;Nội thất cao cấp, nội thất ho&agrave;n to&agrave;n mới, c&oacute; sẳn tủ kệ bếp, m&aacute;y nước n&oacute;ng năng lượng mặt trời, giếng trời, ph&ograve;ng ngủ c&oacute; m&aacute;y lạnh, thiết kế tủ gỗ &acirc;m tường, tranh nghệ thuật, r&egrave;m cửa, đ&egrave;n ch&ugrave;m lớn ở ph&ograve;ng kh&aacute;ch&amp;#8230;Khu vực d&acirc;n tr&iacute; cao, hẻm an ninh gần chợ, bệnh viện, chung cư,nh&agrave; s&aacute;ch, trường học c&aacute;c cấp,đi ng&atilde; tư bốn x&atilde; 4 ph&uacute;t&amp;#8230;. Sổ hồng ri&ecirc;ng đầy đủ, bao sang t&ecirc;n, được hỗ trợ vay 70% vốn ng&acirc;n h&agrave;ng. Gi&aacute; 3.61 tỷ thương lượng. LH A Dũng 0938940970, mong gặp kh&aacute;ch thiện ch&iacute;, Kh&ocirc;ng qua trung gian!.', '78', null);
