INSERT INTO `contents` VALUES ('62', 'Phòng trọ cao cấp, full nội thất, giờ giấc tự do ở CMT8', '5 triệu', '[\"f119a3f6769445669b3a408b4660b4d6.jpg\",\"ed8307dd6607475283357b721aa1fa89.jpg\"]', ' Cách Mạng Tháng 8, Quận 10, TP.HCM', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 5 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 30 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2396828&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', 'Cho thu&ecirc; ph&ograve;ng đẹp, đầy đủ tiện nghi, giờ giấc tự do &lt;br /&gt;Địa chỉ: Hẻm 601 CMT8, Quận 10&lt;br /&gt;+ Đi ra quận 1 chỉ 5-7 ph&uacute;t, thoải m&aacute;i với nhiều hướng đi.&lt;br /&gt;+ Gần bệnh viện, trạm xăng, nh&agrave; văn h&oacute;a, c&ocirc;ng vi&ecirc;n L&ecirc; Thị Ri&ecirc;ng, c&ocirc;ng vi&ecirc;n Ho&agrave;ng Văn Thụ,...&lt;br /&gt;+ Đường &ocirc; t&ocirc; thuận tiện, rộng r&atilde;i.&lt;br /&gt;+ Nh&agrave; c&oacute; camera an ninh&lt;br /&gt;Ph&ograve;ng rộng r&atilde;i, tho&aacute;ng m&aacute;t, trang bị sẵn cho bạn đầy đủ tiện nghi, bạn chỉ cần x&aacute;ch vali đến v&agrave; ở:&lt;br /&gt;- M&aacute;y lạnh.&lt;br /&gt;- Giường, nệm.&lt;br /&gt;- Tủ quần &aacute;o rộng r&atilde;i&lt;br /&gt;- Tủ lạnh&lt;br /&gt;- Toilet cao cấp, ti&ecirc;u chuẩn kh&aacute;ch sạn&lt;br /&gt;- M&aacute;y nước n&oacute;ng năng lượng mặt trời, kh&ocirc;ng hao điện&lt;br /&gt;- M&aacute;y giặt d&ugrave;ng chung.&lt;br /&gt;- Truyền h&igrave;nh c&aacute;p + internet wifi.&lt;br /&gt;Tiện &iacute;ch: Giờ giấc tự do, c&oacute; bếp d&ugrave;ng chung ho&agrave;n to&agrave;n free, c&oacute; chỗ để xe, kh&ocirc;ng chung chủ, khu vực chung (chỗ để xe, cầu thang&amp;#8230;) sạch sẽ c&oacute; nh&acirc;n vi&ecirc;n dọn dẹp vệ sinh 3 tuần lần khu vực nh&agrave; vệ sinh v&agrave; h&agrave;nh lang, cầu thang, bếp&amp;#8230;.&lt;br /&gt;C&aacute;c ph&ograve;ng được trang tr&iacute; rất đẹp, h&agrave;i h&ograve;a, hiện đại&lt;br /&gt;&lt;br /&gt;Gi&aacute;: 5triệu / th&aacute;ng&lt;br /&gt;Nước: 100 ng&agrave;n /người &lt;br /&gt;Điện: 3.5 ng&agrave;n /KWh.', '503', null);
INSERT INTO `contents` VALUES ('63', 'Cho thuê phòng trọ đầy đủ tiện nghi, giờ giấc tự do gần chợ Tân Bình', '4 triệu 900 nghìn', '[\"1059f76293644aa39cfba4990a853778.jpg\",\"11553efb51104fe68e7a2cd650c6bc1b.jpg\",\"22416550b20b47a2961b3a5e85655ef5.jpg\"]', ' Lý Thường Kiệt, Quận 10, TP.HCM', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 4 triệu 900 ngh&igrave;n&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 30 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2410560&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', 'Cho thu&ecirc; ph&ograve;ng cao cấp, giờ giấc tự do, đầy đủ nội thất. &lt;br /&gt;-Địa chỉ: Số 231 Nghĩa ph&aacute;t&lt;br /&gt;+ Thuận tiện giao th&ocirc;ng mọi khu vực.&lt;br /&gt;+ Nhiều nh&agrave; h&agrave;ng qu&aacute;n ăn nhộn nhịp đ&ocirc;ng vui.&lt;br /&gt;+ Đường lớn, &ocirc; t&ocirc; di chuyển thuận tiện thoải m&aacute;i.&lt;br /&gt;+ Khu vực an ninh c&oacute; camera an ninh của c&ocirc;ng an phường.&lt;br /&gt;Ph&ograve;ng đẹp c&oacute; nh&agrave; vệ sinh ri&ecirc;ng, đầy đủ tiện nghi, ph&ograve;ng mang nhiều m&agrave;u sắc bạn thoải m&aacute;i lựa chọn ph&ugrave; hợp với phong c&aacute;ch của bản th&acirc;n. Ph&ograve;ng bao gồm c&aacute;c tiện nghi ho&agrave;n to&agrave;n mới, đ&atilde; setup ho&agrave;n hảo bạn chỉ việc x&aacute;ch va li đến v&agrave; ở.&lt;br /&gt;- M&aacute;y lạnh.&lt;br /&gt;- Giường, đệm, gối&amp;#8230;.&lt;br /&gt;- Tủ quần &aacute;o.&lt;br /&gt;- Tủ lạnh.&lt;br /&gt;- Nước n&oacute;ng lạnh năng lượng mặt trời.&lt;br /&gt;- M&aacute;y giặt free&lt;br /&gt;- Wifi c&aacute;p quang, truyền h&igrave;nh c&aacute;p.&lt;br /&gt;- Tiện &iacute;ch: Giờ giấc tự do, kh&ocirc;ng chung chủ, khu vực chung c&oacute; nh&acirc;n vi&ecirc;n dọn dẹp vệ sinh 3 lần/ tuần. Dịch vụ k&egrave;m theo ho&agrave;n hảo, chất lượng, nhiệt t&igrave;nh&lt;br /&gt;Nước: 100 ng&agrave;n /người.&lt;br /&gt;Điện: 3.5ng&agrave;n /KWh.&lt;br /&gt;Net: 100 ng&agrave;n/ph&ograve;ng.&lt;br /&gt;Gi&aacute; ph&ograve;ng: từ 4.8triệu đến 5.2triệu', '504', null);
INSERT INTO `contents` VALUES ('64', 'Phòng trọ cho thuê 343/2G Tô Hiến Thành quận 10, giá rẻ,', '4 triệu', '[\"3ecf84d5a6de48fda2466de975836997.jpg\",\"4196c7683f3740139e1b639c145896f0.jpg\",\"59cd693f980941d0afd68d6536ad103d.jpg\",\"f64d634b30a24d5b9b44d5af49606022.jpg\",\"3ceec0aad79a431696f8033d26930670.jpg\"]', ' Tô Hiến Thành, Phường 12, Quận 10, TP.HCM', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 4 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 40 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2334651&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', 'Nh&agrave; đ&uacute;c nguy&ecirc;n căn, ph&ograve;ng mới, sạch đẹp ngay trung t&acirc;m Q. 10, gần chợ, gần Big C, gần bệnh viện, gần trường đại học B&aacute;ch Khoa, khoa học tự nhi&ecirc;n, gần bệnh viện 115, đại học Huflit, gần c&ocirc;ng vi&ecirc;n,... Tiện đi lại mua sắm, c&ocirc;ng việc, giải tr&iacute;, thể thao,.... Hẻm xe hơi, rộng r&atilde;i, y&ecirc;n tĩnh, khu tr&iacute; thức, văn minh, c&oacute; cửa v&agrave; ban c&ocirc;ng nh&igrave;n ra b&ecirc;n ngo&agrave;i tho&aacute;ng m&aacute;t tiện cho việc học tập, cho sinh vi&ecirc;n ở đ&ocirc;ng dể dễ share tiền ph&ograve;ng, tiện cho gia đ&igrave;nh ở,... C&oacute; hợp đồng đảm bảo kh&ocirc;ng l&ecirc;n tiền ph&ograve;ng, để được hưởng nhiều lợi &iacute;ch khi bạn thu&ecirc; ph&ograve;ng.....(li&ecirc;n hệ trước để hẹn xem ph&ograve;ng). &lt;br /&gt;&lt;br /&gt;Ph&ograve;ng c&oacute; thể ở từ 3 - 4 - 6 người. Giờ giấc tự do giao ch&igrave;a kh&oacute;a nh&agrave;,&lt;br /&gt;Ph&ograve;ng khoảng 35m2 ở được 3-6 người: 4.000.000đ/th&aacute;ng. &lt;br /&gt;&lt;br /&gt;LH: Ho&agrave;ng 097.778.4909. &lt;br /&gt;&lt;br /&gt;343/2G T&ocirc; Hiến Th&agrave;nh, P12, Q10, &lt;br /&gt;&lt;br /&gt;Li&ecirc;n hệ ch&iacute;nh chủ Mr Ho&agrave;ng: 097.778.4909, (hỗ trợ sinh vi&ecirc;n li&ecirc;n hệ sớm để c&ograve;n ph&ograve;ng đẹp).', '505', null);
INSERT INTO `contents` VALUES ('65', 'Nhà trọ cho thuê 343/2G tô hiến thành, quận 10 giá rẻ gần nhiều trường', '2 triệu 500 nghìn', '[\"3e9b2c51e70249f582518af6ebe1482f.jpg\",\"38e246ab11d546e8830dddd78572c6cd.jpg\",\"8890c9cd09f340c68e6584bca52b3cc2.jpg\"]', ' Tô Hiến Thành, Phường 12, Quận 10, TP.HCM', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 2 triệu 500 ngh&igrave;n&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 18 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2376292&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', 'Nh&agrave; đẹp cho sinh vi&ecirc;n, c&aacute;c anh chị thu&ecirc; ph&ograve;ng tại địa chỉ 343/2G T&ocirc; Hiến Th&agrave;nh, P12, Q10 TPHCM.&lt;br /&gt;&lt;br /&gt;Nh&agrave; ngay trung t&acirc;m quận 10, ngay ng&atilde; tư T&ocirc; Hiến Th&agrave;nh với th&agrave;nh th&aacute;i. Gần chợ, Big C, biện viện 115, gần c&aacute;c trường đại học B&aacute;ch khoa, khoa học tự nhi&ecirc;n, Đại Học Tin Học Huflit, H&ugrave;ng Vương,......... Hẻm xe hơi, an ninh, rộng r&atilde;i, y&ecirc;n tĩnh tiện cho việc học tập, khu tr&iacute; thức, văn minh, c&oacute; cửa sổ, ban c&ocirc;ng, c&oacute; chỗ phơi đồ, đươc nấu ăn, truyền h&igrave;nh c&aacute;p free, wifi free, internet, c&oacute; chỗ để xe miễn ph&iacute; &lt;br /&gt;&lt;br /&gt;trong nh&agrave; rộng r&atilde;i, c&oacute; lối đi ri&ecirc;ng kh&ocirc;ng chung chủ, giờ giấc tự do,....Ph&ograve;ng c&oacute; thể ở từ 2-3 người &lt;br /&gt;&lt;br /&gt;.Li&ecirc;n hệ ch&iacute;nh chủ Mr Ho&agrave;ng: 097.778.4909 .( hỗ trợ sinh vi&ecirc;n li&ecirc;n hệ sớm để c&ograve;n ph&ograve;ng đẹp) Hẹn gặp c&aacute;c bạn tại căn ph&ograve;ng l&yacute; tưởng nh&eacute;.', '506', null);
