INSERT INTO `contents` VALUES ('87', 'Bán Nhà Triệu Việt Vương, Quận Hai Bà Trưng, Víp. 3.6 tỷ.', '3 tỷ 600 triệu', '[\"5a8ad217954541efa0f9072f2cdfd8de.jpg\",\"398ee44295c6478082629f25af58ac6c.jpg\",\"1e1a0878bf75419e9ee1a0918a0d61f6.jpg\"]', ' Triệu Việt Vương, Phường Bùi Thị Xuân, Quận Hai Bà Trưng, Hà Nội', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 3 tỷ 600 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 30 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: 28 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2403679&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: 4&lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: 4&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ đỏ&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', 'B&aacute;c Hoa Kinh doanh V&agrave;ng cần b&aacute;n nh&agrave; chuyển mặt phố cần b&aacute;n gấp nh&agrave; Triệu Việt Vương. Khu vực đắc địa nhất quận Hai B&agrave; Trưng giao nhiều tuyến đường kinh tế huyết mạch Phố Cổ, Phố Huế, Trần Xu&acirc;n Soạn, Trần Kh&aacute;t Ch&acirc;n, B&agrave; triệu, Đo&agrave;n Trần Nghiệp, Mai Hắc Đế, 10 ph&uacute;t l&ecirc;n Hồ ho&agrave;n kiếm. Nh&agrave; ph&ugrave; hợp để ở.&lt;br /&gt;Thiết kế nh&agrave; 5 tầng, mặt tiền 4m : 2 mặt tho&aacute;ng.&lt;br /&gt;- Mỗi tầng 1 ph&ograve;ng rộng r&atilde;i, nội thất bắt mắt kh&aacute;ch về chỉ việc ở. &lt;br /&gt;- Sổ đỏ ch&iacute;nh chủ, ph&aacute;p l&yacute; r&otilde; r&agrave;ng.&lt;br /&gt;-Gi&aacute; 3.6 tỷ - thương lượng kh&aacute;ch thiện tr&iacute;. &lt;br /&gt;Nh&agrave; cực hiếm chỉ cho người nhanh tay nhất.&lt;br /&gt;Li&ecirc;n Hệ : Huy Ho&agrave;ng 01234080694. &lt;br /&gt;Miễn ph&iacute; to&agrave;n bộ dịch vụ: Tư vấn, đ&oacute;n đưa kh&aacute;ch đi xem nh&agrave;, tư vấn phong thủy, ph&aacute;p l&yacute;, ho&agrave;n th&agrave;nh thủ tục mua b&aacute;n, sang t&ecirc;n đổi chủ sổ đỏ, hỗ trợ giải ph&aacute;p khi kh&aacute;ch mua nh&agrave; thiếu tiền... Gi&uacute;p kh&aacute;ch h&agrave;ng mua được nh&agrave;, đất với gi&aacute; rẻ nhất, nhanh ch&oacute;ng nhất.&lt;br /&gt;+ Cam kết ko c&agrave;i cắm, kh&aacute;ch h&agrave;ng tự đ&agrave;m ph&aacute;n gi&aacute; cả với chủ nh&agrave;.', '587', null);
