2 x 5 tầng, mặt tiền 4.6m.&lt;br /&gt;+ Sổ đỏ, giấy ph&eacute;p x&acirc;y dựng, bản vẽ thiết kế đầy đủ, ch&iacute;nh chủ&lt;br /&gt;+ Gi&aacute; ch&agrave;o: 3.6 tỷ - thương lượng kh&aacute;ch thiện ch&iacute;.&lt;br /&gt;+ Li&ecirc;n hệ xem nh&agrave;: (Huy Ho&agrave;ng) 01234.080.694&lt;br /&gt;+ Miễn ph&iacute; to&agrave;n bộ dịch vụ: Tư vấn, đ&oacute;n đưa kh&aacute;ch đi xem nh&agrave;, tư vấn phong thủy, ph&aacute;p l&yacute;, ho&agrave;n th&agrave;nh thủ tục mua b&aacute;n, sang t&ecirc;n đổi chủ sổ đỏ, hỗ trợ giải ph&aacute;p khi kh&aacute;ch mua nh&agrave; thiếu tiền... Gi&uacute;p kh&aacute;ch h&agrave;ng mua được nh&agrave;, đất với gi&aacute; rẻ nhất, nhanh ch&oacute;ng nhất.', '594', null);
INSERT INTO `contents` VALUES ('95', 'Nhà mới đón xuân vạn sự như ý bán nhà 4 tầng ô tô vào nhà ngõ 43 Trung', '7 tỷ 800 triệu', '[\"25624aad100f4b2f8ec115aa4702a0cd.jpg\"]', ' Trung Kính, Phường Yên Hòa, Quận Cầu Giấy, Hà Nội', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 7 tỷ 800 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: 55 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2412433&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: 0&lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: 0&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ đỏ&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Đ&ocirc;ng Nam&lt;/li&gt; &lt;/ul&gt; ', 'Diện t&iacute;ch: 55m2 Hướng Đ&ocirc;ng Nam - T&acirc;y Nam Mặt tiền rộng 6m. Đường trước nh&agrave; 5m &ocirc; t&ocirc; v&agrave;o nh&agrave;, gần hồ Trung K&iacute;nh, nh&agrave; th&ocirc;ng từ ng&otilde; 43 sang ng&otilde; 81 trung k&iacute;nh, th&ocirc;ng ra ng&otilde; 110 Trần Duy Hưng. Gần chợ gần c&aacute;c Trung T&acirc;m Thương Mại lớn nhất Khu Trung H&ograve;a. Nh&agrave; thiết kế hiện đại mỗi tầng 2 ph&ograve;ng ngủ v&agrave; 2 vệ sinh kh&eacute;p k&iacute;n, trang thiết bị ti&ecirc;n tiến bậc nhất. Nh&agrave; c&oacute; thể l&agrave;m văn ph&ograve;ng hay tạp h&oacute;a, kinh doanh qu&aacute;n cơm......... Hiện tại gia đ&igrave;nh cần b&aacute;n gấp l&ecirc;n để lại gi&aacute; rẻ nhất cho kh&aacute;ch h&agrave;ng thiện tr&iacute;. Gi&aacute; B&aacute;n 7,8 tỷ ( c&oacute; thương lượng ) Sổ đỏ ch&iacute;nh chủ. Li&ecirc;n Hệ Anh H&agrave; 0944505445 &amp;#8211; 0961979695', '595', null);
