INSERT INTO `contents` VALUES ('99', 'Cho thuê nhà mặt phố nguyễn ngọc vũ, diện tích 50m, xây 7 tầng', '50 triệu', '[\"08862863337944c1ad6d87b3454f3019.jpg\"]', ' Nguyễn Ngọc Vũ, Phường Trung Hoà, Quận Cầu Giấy, Hà Nội', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 50 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 350 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: 50 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2392802&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: 7&lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: 7&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', 'Cho thu&ecirc; nh&agrave; mặt phố nguyễn ngọc vũ, quận thanh xu&acirc;n, diện t&iacute;ch s&agrave;n 50m, x&acirc;y 7 tầng thang m&aacute;y, tổng diện t&iacute;ch sử dụng l&agrave; 350m, s&agrave;n th&ocirc;ng thiết kế kiểu văn ph&ograve;ng cho thu&ecirc;, nh&agrave; đầy đủ nội thất: thiết bị vệ sinh, trần thạch cao, điều h&ograve;a, n&oacute;ng lạnh. Vỉa h&egrave; rộng 8m, đường rộng 40m, cho để xe thoải m&aacute;i, vị tr&iacute; đắc địa, khu vực trung t&acirc;m, rất th&iacute;ch hợp l&agrave;m văn ph&ograve;ng c&ocirc;ng ty, ng&acirc;n h&agrave;ng, trung t&acirc;m tiếng anh&amp;#8230;Gi&aacute; thu&ecirc; 50 triệu/th&aacute;ng. Qu&yacute; kh&aacute;ch c&oacute; nhu cầu vui l&ograve;ng li&ecirc;n hệ: 0909.628.669', '629', null);
