INSERT INTO `contents` VALUES ('109', 'Nhận ngay gói ưu đã 0% khi mua căn hộ tại Sky central 176 Định Công', '2 tỷ 200 triệu', '[\"8c2850a8146247efa64cbc8afaa9d21a.jpg\",\"0facd82a871a4ab6bd3bc60e4f8d4bcb.jpg\",\"708083837e494c45af60bca009081b5f.jpg\"]', ' Định Công, Phường Định Công, Quận Hoàng Mai, Hà Nội', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 2 tỷ 200 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 90 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2412044&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: 3&lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: 2&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ hồng&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Đ&ocirc;ng Nam&lt;/li&gt; &lt;/ul&gt; ', 'Nằm tr&ecirc;n 5 trục đường huyết mạch : Giải Ph&oacute;ng, Kim Đồng, Định C&ocirc;ng, L&ecirc; Trọng Tấn, v&agrave;nh đai 2,5. X&acirc;y dựng tr&ecirc;n mặt bằng cao kh&ocirc;ng bị ngập nước.&lt;br /&gt;Dự &aacute;n gồm 2 t&ograve;a A v&agrave; B cao 26 tầng v&agrave; 3 tầng hầm th&ocirc;ng khối. Đầy đủ tiện &iacute;ch bể bơi, trung t&acirc;m thương mại, spa, gym, caf&eacute;, c&ocirc;ng vi&ecirc;n, đ&agrave;i phun nước, trường mầm non ri&ecirc;ng.&lt;br /&gt;Gần c&aacute;c bệnh viện lớn, bến xe v&agrave; c&aacute;c trường đại học danh tiếng&amp;#8230;trường cấp 2, cấp 3.&lt;br /&gt;C&aacute;c căn hộ c&oacute; diện t&iacute;ch đa dạng:&lt;br /&gt;T&ograve;a A: &lt;br /&gt;+ Căn hộ 2 ph&ograve;ng ngủ: 65,9m2, 66,3m2, 73,4m2&lt;br /&gt;+ Căn hộ 3 ph&ograve;ng ngủ: 79m2, 87m2, 90,8m2, 104m2&lt;br /&gt;T&ograve;a B:&lt;br /&gt;+ Căn hộ 2 ph&ograve;ng ngủ: 64m2, 68m2, 73m2&lt;br /&gt;+ Căn hộ 3 ph&ograve;ng ngủ: 80m2, 92m2, 99m2&lt;br /&gt;*** Gi&aacute; chỉ từ 25 triệu/m2&lt;br /&gt;** Dự kiến b&agrave;n giao qu&yacute; I năm 2019&lt;br /&gt;Ri&ecirc;ng khu nh&agrave; ở bố tr&iacute; 10 thang m&aacute;y, đảm bảo kh&ocirc;ng gian cho người thụ hưởng.&lt;br /&gt;**Ch&iacute;nh s&aacute;ch hỗ trợ kh&aacute;ch h&agrave;ng:&lt;br /&gt;Chủ đầu tư:&lt;br /&gt;+ Hỗ trợ l&atilde;i suất 0% đến khi nhận nh&agrave;&lt;br /&gt;+ Kh&ocirc;ng nhận g&oacute;i hỗ trợ 0% được triết khấu 1 tri&ecirc;u/m2&lt;br /&gt;Ng&acirc;n h&agrave;ng SHB:&lt;br /&gt;+ Cho vay 70% gi&aacute; trị căn hộ l&ecirc;n đến 20 năm&lt;br /&gt;Tiến độ đ&oacute;ng tiền linh hoạt 7 đợt.', '665', null);
INSERT INTO `contents` VALUES ('110', 'Chung cư Nguyễn CHí Thanh - Láng Thượng, 48m2/2pn,tặng 30tr, ở ngay', '1 tỷ 30 triệu', '[\"a2eee4a7a7334fd394be7033180d2831.jpg\"]', ' Nguyễn Chí Thanh, Quận Cầu Giấy, Hà Nội', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 1 tỷ 30 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 48 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2411924&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: 2&lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: 1&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ hồng&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', 'Chung cư Nguyễn Ch&iacute; Thanh- L&aacute;ng Thượng, 46m2/2 ngủ, full nội thất&lt;br /&gt;1. Vị tr&iacute; chung cư mini Nguyễn Ch&iacute; Thanh. &lt;br /&gt;T&ograve;a chung cư mini Nguyễn ch&iacute; Thanh tọa lạc tại vị tr&iacute; trung t&acirc;m của th&agrave;nh phố H&agrave; Nội &lt;br /&gt;Nằm ngay ch&acirc;n cầu vượt Nguyễn Ch&iacute; Thanh - Trần Duy Hưng gần c&aacute;c trường ĐH lớn như ĐH Ngoại Thương, ĐH Luật, ĐH Lao Động X&atilde; Hội. &lt;br /&gt;gần rạp chiếu phim quốc gia &lt;br /&gt;Tiếp gi&aacute;p c&aacute;c tuyền phố lớn sầm uất :Trần Duy Hưng, đường L&aacute;ng - Nguyễn Khang, Đ&ecirc; La Th&agrave;nh, l&aacute;ng Hạ, ...&lt;br /&gt;2. Diện t&iacute;ch v&agrave; gi&aacute; b&aacute;n &lt;br /&gt;Chung cư mini Nguyễn Ch&iacute; Thanh được thiết kế với nhiều diện t&iacute;ch kh&aacute;c nhau: Từ 43m2 - 46m2 với 2PN đẹp tho&aacute;ng&lt;br /&gt;Gi&aacute; từ 1,07 - 1,2 tỷ t&ugrave;y căn tầng v&agrave; diện t&iacute;ch. &lt;br /&gt;(TẶNG NGAY 30 TR Đ&Oacute;N TẾT)&lt;br /&gt;Nội thất căn hộ gồm c&oacute;: Trần trang tr&iacute; thạch cao, điều h&ograve;a, tủ &acirc;m tường, tủ bếp, s&agrave;n gỗ, bếp, b&igrave;nh n&oacute;ng lạnh. &lt;br /&gt;3. T&iacute;nh chất ph&aacute;p l&yacute;: &lt;br /&gt;+ Hợp đồng mua b&aacute;n căn hộ. &lt;br /&gt;+ T&aacute;ch sổ ri&ecirc;ng từng căn. &lt;br /&gt;+ Giấy ph&eacute;p x&acirc;y dựng (bản sao c&oacute; c&ocirc;ng chứng). &lt;br /&gt;+ Sổ đỏ của l&ocirc; đất (bản sao c&oacute; c&ocirc;ng chứng). &lt;br /&gt;Li&ecirc;n hệ ngay CĐT để nhận gi&aacute; gốc v&agrave; xem nh&agrave;', '666', null);
INSERT INTO `contents` VALUES ('111', 'Đón Tết Mua Nhà - Rinh quà may Mắn 30 triệu. Chung cư Nguyên Hồng 46m', '1 tỷ 70 triệu', '[\"9e41e26d8fe04a2ab7c965cf6e38d24c.jpg\"]', ' Nguyên Hồng, Quận Cầu Giấy, Hà Nội', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 1 tỷ 70 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 46 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2411975&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: 2&lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: 1&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ hồng&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', 'Đ&oacute;n Tết Mua Nh&agrave; - Rinh qu&agrave; may Mắn 30 triệu. Chung cư Nguy&ecirc;n Hồng - Nguyễn CH&iacute; Thanh ở ngay, full nội thất, oto đỗ cửa&lt;br /&gt;&lt;br /&gt;1. Vị tr&iacute;: Nằm tại ng&atilde; tư cầu vượt Nguyễn Ch&iacute; Thanh - Trần Duy Hưng - L&aacute;ng c&aacute;ch mặt đường Nguyễn Ch&iacute; Thanh 20m, c&oacute; giao th&ocirc;ng v&ocirc; c&ugrave;ng thuận lợi, được hưởng những tiện &iacute;ch v&agrave; cơ sở hạ tầng sẵn c&oacute; xung quanh.&lt;br /&gt;&lt;br /&gt;2. Diện t&iacute;ch &amp;amp; Gi&aacute; b&aacute;n: C&aacute;c căn hộ được thiết kế rộng 45m2 - 46m2 gồm 1 - 2PN tiện nghi + 1 ph&ograve;ng kh&aacute;ch + 1 vệ sinh + kh&ocirc;ng gian bếp ri&ecirc;ng biệt v&agrave; 1 ban c&ocirc;ng.&lt;br /&gt;Căn 43m2 gi&aacute; từ 1,07 tỷ - 1,09 tỷ. Căn 46m2 gi&aacute; từ 1,17 tỷ - 1,18 tỷ.&lt;br /&gt;&lt;br /&gt;Mua Chung cư Nguyễn Ch&iacute; Thanh kh&aacute;ch h&agrave;ng ko phải mất th&ecirc;m chi ph&iacute; n&agrave;o, k&yacute; hợp đồng trực tiếp CĐT với đầy đủ ph&aacute;p l&yacute; : sổ đỏ PTCC, giấy ph&eacute;p XD, hợp đồng mua b&aacute;n, mặt bằng căn hộ, danh mục thiết bị, nội qui sử dụng,&amp;#8230;&lt;br /&gt; Li&ecirc;n hệ trực tiếp CĐT để nhận bảng gi&aacute; gốc v&agrave; đi xem nh&agrave; miễn ph&iacute;', '667', null);
INSERT INTO `contents` VALUES ('112', 'Bán căn hộ chung cư phố Hoàng Hoa Thám, Đội Cấn, quận Ba Đình.', '470 triệu', '[\"413a02d2f90d4587bb8146f94f5000ec.jpg\",\"41bc9682b6934e96a3d6dd283f1ae12e.jpg\",\"8492715f614c481f9167992ae4b69a4e.jpg\"]', ' Hoàng Hoa Thám, Quận Ba Đình, Hà Nội', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 470 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 25 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2193946&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: 2&lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: 2&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ hồng&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', 'Li&ecirc;n hệ chủ đầu tư: 0981.979.838&lt;br /&gt;- Chủ đầu tư mở b&aacute;n trực tiếp chung cư cao cấp tại quận Ba Đ&igrave;nh - phố Vĩnh Ph&uacute;c, Đội Cấn, Ho&agrave;ng Hoa Th&aacute;m.&lt;br /&gt;- Vị tr&iacute;: Ng&otilde; 75 phố Vĩnh Ph&uacute;c, Đội Cấn, ng&otilde; rộng, 3 mặt tho&aacute;ng. T&ograve;a nh&agrave; nằm giữa trung t&acirc;m H&agrave; Nội, giao th&ocirc;ng đi lại thuận tiện. C&oacute; nhiều loại diện t&iacute;ch v&agrave; gi&aacute; cả hợp l&yacute; cho kh&aacute;ch h&agrave;ng lựa chọn.&lt;br /&gt;- Diện t&iacute;ch: 25m2, 43m2, 45m2, 48m2, 52m2, 55m2, 60m2.&lt;br /&gt;- Gi&aacute; b&aacute;n 470 triệu, 750 triệu, 800 triệu, 870 triệu, 930 triệu.&lt;br /&gt;Gồm 1 - 2 ph&ograve;ng ngủ, ph&ograve;ng kh&aacute;ch, bếp v&agrave; 2 vệ sinh, s&agrave;n gỗ v&agrave; nội thất cao cấp, thiết kế hiện đại, c&aacute;c căn hộ đều nhiều &aacute;nh s&aacute;ng tự nhi&ecirc;n.&lt;br /&gt;C&oacute; sổ đỏ ri&ecirc;ng, hợp đồng mua b&aacute;n c&ocirc;ng chứng nh&agrave; nước.&lt;br /&gt;Li&ecirc;n hệ trực tiếp với chủ đầu tư để xem nh&agrave; v&agrave; mua gi&aacute; gốc.&lt;br /&gt;Li&ecirc;n hệ chủ đầu tư: 0981.979.838&lt;br /&gt;+ M&ocirc; Tả:&lt;br /&gt;- T&ograve;a nh&agrave; 6 tầng x&acirc;y dựng tr&ecirc;n diện t&iacute;ch đất 380m2, tầng trệt khu để xe chứa được 260 xe m&aacute;y, t&ograve;a nh&agrave; c&oacute; 2 thang m&aacute;y nhật nhập khẩu, thang bộ, hệ thống ph&ograve;ng ch&aacute;y chữa ch&aacute;y ti&ecirc;u chuẩn, đ&egrave;n Led điện, nước, internet, truyền h&igrave;nh c&aacute;p ri&ecirc;ng biệt, bảo vệ', '668', null);
INSERT INTO `contents` VALUES ('113', 'Bán chung cư Đội Cấn Ba Đình vào ở ngay đầy đủ nội thất', '850 triệu', '[\"b456f346a7ea41709aaa9ac485e10139.jpg\",\"185606cedb4448ebad8de2eba2bfd023.jpg\"]', ' Đội Cấn, Quận Ba Đình, Hà Nội', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 850 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 31 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2193947&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: 2&lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: 2&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Giấy tờ hợp lệ&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', 'CĐT trực tiếp b&aacute;n ccmn Đội Cấn- Ngọc H&agrave; chỉ từ 840 triệu/căn, ở ngay, đủ nội thất cơ bản&lt;br /&gt;Vị tr&iacute;: Đường Đội Cấn - Ngọc Hà, Quận Ba Đ&igrave;nh, H&agrave; Nội,&lt;br /&gt;Tiện &iacute;ch: Cạnh chung cư c&oacute; hồ điều h&ograve;a tiện lợi cho đi bộ thể dục quanh hồ hoặc h&oacute;ng gi&oacute;. Đời sống d&acirc;n tr&iacute; cao. Đi c&ocirc;ng vi&ecirc;n B&aacute;ch Thảo, Lăng B&aacute;c chỉ mất 5 ph&uacute;t&lt;br /&gt;Thiết kế: căn hộ vu&ocirc;ng tho&aacute;ng c&ocirc;ng năng sử dụng tốt. &lt;br /&gt;+ Mật độ d&acirc;n cư kh&ocirc;ng qu&aacute; đ&ocirc;ng( 1 s&agrave;n gồm 4 căn)&lt;br /&gt;+ Đặc biệt đối với những người đang sống v&agrave; l&agrave;m việc tại quận Ba Đ&igrave;nh( Xung quanh c&aacute;c tuyến đường: Ho&agrave;ng Hoa tH&aacute;m, Đội Cấn, Giang Văn Minh, ngọc h&agrave;......)&lt;br /&gt;+ Căn 1 ngủ: 31m2. Gi&aacute; b&aacute;n 850tr - 900tr&lt;br /&gt;+ Căn 2 ngủ: 43m2 -45m2. Gi&aacute; giao động 1,180tr - 1,200tr&lt;br /&gt;- Căn hộ đ&atilde; ho&agrave;n thiện với nội thất cơ bản đầy đủ&lt;br /&gt;Ưu Đ&atilde;i: Chiết khấu 1 -2% gi&aacute; trị căn hộ cho c&aacute;c kh&aacute;ch h&agrave;ng đặt mua sớm nhất&lt;br /&gt;DỰ ÁN CHỦ Đ&Acirc;̀U TƯ - MI&Ecirc;̃N M&Ocirc;I GIỚI CẢM ƠN', '669', null);
INSERT INTO `contents` VALUES ('114', 'Bán căn Hộ chung cư mini Vĩnh phúc Ba Đình vào ở ngay giá chỉ từ 470tr', '850 triệu', '[\"781cb17d71b84461bf3adddff2a60ba4.jpg\"]', ' Vĩnh Phúc, Quận Ba Đình, Hà Nội', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 850 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 32 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2193948&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: 2&lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: 2&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ hồng&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', 'Dự &aacute;n hot chung cư mini vĩnh Ph&uacute;c - Ba Đ&igrave;nh.&lt;br /&gt;Chủ đầu tư trực tiếp b&aacute;n căn hộ chung cư mini ng&otilde; 75 Vĩnh Ph&uacute;c, Ba Đ&igrave;nh.&lt;br /&gt;LH CĐT: 0981.979.838.&lt;br /&gt;Vị tr&iacute; trung t&acirc;m, thang m&aacute;y, x&acirc;y mới, thiết kế hiện đại, nội thất cao cấp.&lt;br /&gt;Chợ Vĩnh ph&uacute;c c&aacute;ch 200m.&lt;br /&gt;Trường học trong b&aacute;n k&iacute;nh chỉ 300m.&lt;br /&gt;Giao th&ocirc;ng thuận lợi.&lt;br /&gt;To&agrave; nh&agrave; cao 7 tầng 1 tầng trệt để xe m&aacute;y.&lt;br /&gt;Dự &aacute;n gồm c&oacute; 43 căn hộ, mỗi tầng c&oacute; 07 căn hộ.&lt;br /&gt;DT 24m2 - 25m2 - 42m2 - 43m2 - 48m2 - 49m2 - 50m2 - 60m2 - 77m2.&lt;br /&gt;Gi&aacute; giao động trong khoảng từ 420tr -490tr -860tr -880tr -980tr -1000 tỷ - 1 tỷ 400 tr.&lt;br /&gt;C&aacute;c căn hộ được thiết kế từ 1,2,3 ph&ograve;ng ngủ rất hiện đại v&agrave; th&ocirc;ng tho&aacute;ng.&lt;br /&gt;Giấy tờ mua b&aacute;n bao gồm:&lt;br /&gt;Hợp đồng chuyển nhượng căn hộ k&yacute; tại c&ocirc;ng ty hoặc văn ph&ograve;ng c&ocirc;ng chứng. Cam kết t&aacute;ch sổ đỏ theo nghị định 71/CP.&lt;br /&gt;Giấy ph&eacute;p x&acirc;y dựng (bản sao c&oacute; c&ocirc;ng chứng).&lt;br /&gt;Sổ đỏ của l&ocirc; đất (Bản sao c&oacute; c&ocirc;ng chứng).&lt;br /&gt;Hồ sơ thiết kế chi tiết của căn hộ.&lt;br /&gt;Sơ đồ điện, sơ đồ nước.&lt;br /&gt;Tư vấn miễn ph&iacute;, xem nh&agrave; mọi thời gian.&lt;br /&gt;Hotline: 0981.979.838.', '670', null);
INSERT INTO `contents` VALUES ('115', 'Chung cư Hoàng Hoa Thám-Bưởi nhiều diện tích lựa chọn, vào ở ngay đủ đ', '840 triệu', '[\"1e1445de8c8a4ee78dca97054617ad49.jpg\",\"5802dd7af3b94fd282e1563dc5fd9b98.jpg\"]', ' Vĩnh Phúc, Quận Ba Đình, Hà Nội', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 840 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 42 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2194460&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: 2&lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: 1&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Hợp đồng mua b&aacute;n&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Đ&ocirc;ng Nam&lt;/li&gt; &lt;/ul&gt; ', 'Mở b&aacute;n chung cư mini gi&aacute; rẻ nhất tại H&agrave; Nội, chung cư gi&aacute; rẻ Vĩnh Ph&uacute;c - Ho&agrave;ng Hoa Th&aacute;m - Bưởi, quận Ba Đ&igrave;nh! &lt;br /&gt;Chung cư mini vĩnh ph&uacute;c ba đ&igrave;nh gi&aacute; chỉ từ 420tr/căn, v&agrave;o ở ngay vị tr&iacute; trung t&acirc;m quận. &lt;br /&gt;1. Thiết kế: T&ograve;a nh&agrave; được thiết kế 7 tầng, cầu thang m&aacute;y tốc độ cao, nh&agrave; để xe thuộc tầng trệt, rộng r&atilde;i, th&ocirc;ng tho&aacute;ng, hệ thống giếng trời, bể ngầm v&agrave; bể chứa ri&ecirc;ng biệt.. &lt;br /&gt;2. Diện t&iacute;ch v&agrave; gi&aacute; b&aacute;n: Ch&uacute;ng t&ocirc;i thiết kế nhiều loại căn hộ với c&aacute;c diện t&iacute;ch kh&aacute;c nhau để kh&aacute;ch h&agrave;ng c&oacute; thể lựa chọn căn hộ hợp l&yacute; với t&agrave;i ch&iacute;nh của m&igrave;nh. &lt;br /&gt;- CH số 1: DT 48m2 gồm 2 PN, PKB, 2WC, BC mặt trước gi&aacute;: 980 tr; &lt;br /&gt;- CH số 2: DT 21-24 m2 gồm 1 PN, PKB, 1 WC, BC mặt trước gi&aacute;: 420-470 tr; &lt;br /&gt;- CH số 3: DT 22-25 m2 gồm 1 PN, PKB, 1 WC, BC mặt trước gi&aacute;: 440-490 tr; &lt;br /&gt;- CH số 4: DT 50 m2 gồm 2 PN, PKB, 2 WC, BC mặt trước gi&aacute;: 1.020 tr; &lt;br /&gt;- CH số 5: DT 42 m2 gồm 2 PN, PKB, 1 WC, BC mặt ng&otilde; sau gi&aacute;: 860 tr; &lt;br /&gt;- CH số 6: DT 43 m2 gồm 2 PN, PKB, 2 WC, BC mặt ng&otilde; sau gi&aacute;: 860 tr; &lt;br /&gt;- CH số 7: DT 49 m2 gồm 2 PN, PKB, 2 WC,', '671', null);
INSERT INTO `contents` VALUES ('116', 'Chung cư Đội Cấn Ba Đình và ở NGAY gần Hồ điều hòa', '1 tỷ 150 triệu', '[\"4dcf4425876e40ba8ae02fdad4c7a850.jpg\",\"d199377e556a481fa805f8d4ee2b9d38.jpg\"]', ' Đội Cấn, Phường Đội Cấn, Quận Ba Đình, Hà Nội', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 1 tỷ 150 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 43 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2194471&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: 2&lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: 1&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ đỏ&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', '- Chung cư mini Đội Cấn thuộc quận Ba Đ&igrave;nh, trung t&acirc;m h&agrave;nh ch&iacute;nh H&agrave; Nội d&acirc;n tr&iacute; cao an ninh tốt&amp;#8230;.. &lt;br /&gt;- Chung cư mini Đội Cấn rất thuận tiện cho việc học h&agrave;nh cho c&aacute;c con rất gần với c&aacute;c trường như Chu Văn An, Ba Đ&igrave;nh&amp;#8230;. &lt;br /&gt;- Đặc biệt Chung cư mini Đội Cấn c&oacute; gi&aacute; b&aacute;n v&ocirc; c&ugrave;ng hợp l&yacute; phục vụ đối tượng c&oacute; mức thu nhập trung b&igrave;nh kh&aacute;. &lt;br /&gt;- Chất lượng c&ocirc;ng tr&igrave;nh x&acirc;y dựng ho&agrave;n to&agrave;n y&ecirc;n t&acirc;m. &lt;br /&gt;1, Vị tr&iacute; dự &aacute;n. &lt;br /&gt;Chung cư mini Đội Cấn, Ba Đ&igrave;nh nằm tr&ecirc;n địa b&agrave;n quận Ba Đ&igrave;nh, trung t&acirc;m của thủ đ&ocirc; H&agrave; Nội, gần Lăng B&aacute;c, Quảng trường Ba Đ&igrave;nh v&agrave; c&ocirc;ng vi&ecirc;n B&aacute;ch Thảo, thuận tiện giao th&ocirc;ng điện đường trường trạm. &lt;br /&gt;Đặc biệt chung cư mini Đội Cấn l&agrave; ng&otilde; th&ocirc;ng c&oacute; thể đi v&agrave;o từ ng&otilde; 173 Ho&agrave;ng Hoa Th&aacute;m, ng&otilde; 158 Ngọc H&agrave;, ng&otilde; 209 Đội Cấn gần ch&ugrave;a Ba Th&aacute;p. &lt;br /&gt;2, Tổng quan thiết kế. &lt;br /&gt;Ba dự &aacute;n chung cư Đội Cấn gồm 8 tầng căn hộ, 7 căn/tầng + 1 tầng để xe c&oacute; sức chứa hơn 150 xe. Thang m&aacute;y tốc độ cao, thang bộ rộng r&atilde;i. &lt;br /&gt;Mỗi căn hộ được thiết kế với 2 PN, 1 PK + bếp, 1 WC, ban c&ocirc;ng phơi đồ rộng tho&aacute;ng, căn hộ vu&ocirc;ng đẹp b&agrave;i t', '672', null);
INSERT INTO `contents` VALUES ('117', 'Cho thuê văn phòng 65m2 mặt phố Đông Các - Ô Chợ Dừa', '10 triệu', '[\"bb1050675ba8483a819156f063d6699c.jpg\",\"9d3791d008fc4efcbe5080567cfebc9a.jpg\",\"3114b360dedc48ce8663c0fe4a52b4d5.jpg\",\"5a74b9ba75d148a486a15db1c6b0320d.jpg\",\"535d3a87f8704fc29bd790c3e2cd8279.jpg\",\"8d05fe381182471c82ec3958bd5d568b.jpg\",\"41107cbcd07d472698557d9542e84745.jpg\",\"f9fb722da83145869dc92565cdca5b91.jpg\"]', ' Đông Các, Phường Ô Chợ Dừa, Quận Đống Đa, Hà Nội', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 10 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 65 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2405191&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', '1-T&ograve;a nh&agrave; 9 tầng tại số nh&agrave; 23 mặt phố đ&ocirc;ng c&aacute;c đang ho&agrave;n thiện v&agrave;o ở lu&ocirc;n được. &lt;br /&gt;- Nh&agrave; ngay mặt phố Đ&ocirc;ng C&aacute;c, đường rộng, 2 &ocirc; t&ocirc; con tr&aacute;nh nhau, nằm ngay ng&atilde; tư &Ocirc; chợ dừa v&agrave; X&atilde; Đ&agrave;n rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải tr&iacute;. L&ecirc;n phố cổ cũng gần, trung t&acirc;m thương mại ngay s&aacute;t &lt;br /&gt;- C&aacute;c căn hộ rộng được l&aacute;t s&agrave;n gỗ cao cấp, ph&ograve;ng n&agrave;o cũng c&oacute; cửa sổ rộng, ban c&ocirc;ng phơi đồ ri&ecirc;ng biệt. C&aacute;c căn hộ được thiết kế hết sức hợp l&yacute;: &lt;br /&gt;+ Loại 1: Gồm 1 ph&ograve;ng ngủ + 1 ph&ograve;ng kh&aacute;ch, khu bếp c&oacute; b&agrave;n bếp, tủ bếp, h&uacute;t m&ugrave;i, đầy đủ &aacute;nh s&aacute;ng, gi&oacute; v&agrave; kh&ocirc;ng kh&iacute; v&agrave;o ph&ograve;ng. &lt;br /&gt; - DT: 45m2. GI&Aacute; 7,5 TRIỆU/TH&Aacute;NG.&lt;br /&gt;+ Loại 2: Gồm 2 ph&ograve;ng ngủ + 1 ph&ograve;ng kh&aacute;ch v&agrave; ph&ograve;ng bếp ri&ecirc;ng biệt DT: 65-70m2. &lt;br /&gt; - GI&Aacute; 10-12 TRIỆU/TH&Aacute;NG.&lt;br /&gt;+ Địa chỉ: T&ograve;a nh&agrave; 23 Phố Đ&ocirc;ng C&aacute;c- P.&Ocirc; Chợ Dừa -Đống Đa- hn. &lt;br /&gt;LH :CH&Iacute;NH CHỦ CHỊ HƯƠNG 0978 335 871/ 0982 9696 69 / 0986205100', '735', null);
INSERT INTO `contents` VALUES ('118', 'Cho thuê chung cư mini 8 tầng tại số 213 phố Xã Đàn - Nam Đồng', '6 triệu', '[\"8acd60fe93d84031abb1f83ab04a9619.jpg\",\"b0bc2bd017a44a0d8d11ea6745ceddcd.jpg\",\"7c26c5b404cd4fcc94b82ae14871fb5e.jpg\",\"bf7cf46134db4807a6bf66b026876d15.jpg\",\"aaa3a13b065c453eb9aa0c859885fb5a.jpg\",\"a9c24c82795f4c069411f1940ebe2b53.jpg\",\"896e7eb06f1743f992b790b44db672c1.jpg\",\"9e11e21ff4554916b87548157e4cc04d.jpg\",\"4941803caeb944419198f9e050706c85.jpg\",\"7bd93b4c24564ee1b2ef9cb4b37b16f5.jpg\",\"11733bac95a14f439a9e2231964639fe.jpg\",\"ec1153232b4942fcbbb48a2dec7c9f6a.jpg\",\"82001a4c62f14522945880584e118347.jpg\",\"d5f07ac0f81f46aa9f17c32be1a86f60.jpg\",\"1ccf17ea8da9435b819bd5409b583781.jpg\",\"a64e74a0cf4f47778ef8d874e8abb07d.jpg\",\"cc103a0c41a74601be3e7ef6104f5cd5.jpg\",\"e3c447bf7cb5476aaefb35ff687387ea.jpg\",\"6c328d25ae94426ea382293482c635df.jpg\",\"5148a17663af4dc48a5c62db4e4a50e0.jpg\",\"a435f973ca36449182beb93318c7e664.jpg\",\"4187f461834c40ae8567a7de22d28672.jpg\",\"ed6cf86fb3244a528c7c9211a60e55b7.jpg\",\"6dc8217997ec4d7a9ecd8c2cab4cbd51.jpg\",\"68125da0aa5949e0af429f0c3e306530.jpg\",\"84b3c76b4cf14e5d86f41d3996395a43.jpg\",\"8707f7843c33479ba88ce80befe008d6.jpg\"]', 'Số nhà 213 Xã Đàn, Phường Nam Đồng, Quận Đống Đa, Hà Nội', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 6 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 40 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2405217&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', '- Diện t&iacute;ch c&aacute;c ph&ograve;ng từ 35m2 - 40m2.&lt;br /&gt;Gi&aacute; cho thu&ecirc; 6.000.000đ - 7.000.000đ /th&aacute;ng, c&aacute;c căn hộ bao gồm:&lt;br /&gt;1 ph&ograve;ng ngủ + ph&ograve;ng kh&aacute;ch v&agrave; khu bếp ri&ecirc;ng biệt.&lt;br /&gt;- Ph&ograve;ng ngủ được trang bị điều h&ograve;a 2 chiều, giường, tủ quần &aacute;o...&lt;br /&gt;- Ph&ograve;ng bếp được trang bị b&agrave;n bếp, tủ bếp, chậu rửa b&aacute;t...&lt;br /&gt;- Khu vực nh&agrave; vệ sinh được lắp đầy đủ thiết bị hiện đại như chậu rửa mặt, bệt Inax, v&ograve;i sen, b&igrave;nh n&oacute;ng lạnh...&lt;br /&gt;- T&ograve;a nh&agrave; c&oacute; bảo vệ 24/24, đảm bảo an ninh tuyệt đối, giờ giấc ra v&agrave;o thoải m&aacute;i.&lt;br /&gt;- Khu vực ban c&ocirc;ng phơi đồ ri&ecirc;ng biệt của từng ph&ograve;ng.&lt;br /&gt;&lt;br /&gt;* T&ograve;a nh&agrave; nằm ở vị tr&iacute; trung t&acirc;m, giao th&ocirc;ng thuận tiện, c&aacute;ch mặt đường LA TH&Agrave;NH 10m,gần c&aacute;c trung t&acirc;m thương mại, l&ecirc;n phố cổ cũng gần, c&aacute;ch ng&atilde; tư &Ocirc; CHỢ DỪA 300m...&lt;br /&gt;&lt;br /&gt;Địa chỉ: SỐ 213 X&Atilde; Đ&Agrave;N- P .NAM ĐỒNG- Q. Đống Đa.&lt;br /&gt;LH C Hương 0978 335 871 / 0986205100 / 0976 173 640', '736', null);
INSERT INTO `contents` VALUES ('119', 'Cho thuê chính chủ căn hộ mini tại số 78 ngõ 155 Trường Chinh', '5 triệu 500 nghìn', '[\"bbd45a1f3b2c41518f7add4e604340ee.jpg\",\"edc0746559c745d980f57ea7701a4fcf.jpg\",\"c2546ee10ff64f8a9370f410cbb56c4c.jpg\",\"a12846e18dbf40b6b2b434ceb4fb3fc1.jpg\",\"ab1c6eefd458477fa7defb014b413301.jpg\"]', 'ngõ 155 Trường Chinh, Quận Đống Đa, Hà Nội', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 5 triệu 500 ngh&igrave;n&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 45 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2405753&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', 'T&ograve;a nh&agrave; 9 tầng tại số 78 ng&otilde; 155 Trường Chinh:&lt;br /&gt;- Nằm ven hồ R&ugrave;a c&aacute;ch đường Trường Chinh 300m đường v&agrave;o rộng, 2 t&ocirc; con tr&aacute;nh nhau, rất thuận tiện cho việc đi lại, sinh hoạt, vui chơi, giải tr&iacute;. L&ecirc;n phố cổ cũng gần, trung t&acirc;m thương mại ngay s&aacute;t, gần Trường Đại Học Y, trường ĐH Kinh Tế Quốc D&acirc;n...&lt;br /&gt;- Căn hộ rộng 45m2 - 50m2 được l&aacute;t s&agrave;n gỗ, căn n&agrave;o cũng cửa sổ rộng, ban c&ocirc;ng phơi đồ ri&ecirc;ng biệt nh&igrave;n sang hồ điều h&ograve;a, h&iacute;t kh&iacute; trời trong l&agrave;nh n&ecirc;n kh&ocirc;ng độc hại. Căn hộ được thiết kế hết sức hợp l&yacute;, 1 ph&ograve;ng ngủ, 1 ph&ograve;ng kh&aacute;ch, khu bếp c&oacute; đầy đủ &aacute;nh s&aacute;ng, gi&oacute; v&agrave; kh&ocirc;ng kh&iacute; v&agrave;o ph&ograve;ng.&lt;br /&gt;- Mỗi căn hộ được trang bị giường, cửa sổ c&oacute; r&egrave;m Th&aacute;i Tuấn cực đẹp, trần thạch cao, đ&egrave;n ngủ đủ cả, b&agrave;n bếp xịn, h&uacute;t m&ugrave;i, bồn rửa b&aacute;t xịn.&lt;br /&gt;- Nh&agrave; vệ sinh c&oacute; thiết bị vệ sinh Inax cao cấp, ốp l&aacute;t gạch Prime sang trọng.&lt;br /&gt;Gi&aacute; cho thu&ecirc;: 5.000.000 - 5.500.000 đ/căn/th&aacute;ng (thanh to&aacute;n tối thiểu 03 th&aacute;ng v&agrave; đặt cọc 01 th&aacute;ng).&lt;br /&gt;LH CHỊ HƯƠNG 0978 335 871 / 0986 205 100 / 0976 173 640', '737', null);
