/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', 'Chung cư mini 7 tầng c&oacute; nhiều loại ph&ograve;ng cho thu&ecirc; tại số 118 Nguyễn Đổng Chi.&lt;br /&gt;+ C&oacute; 1 ph&ograve;ng ngủ + ph&ograve;ng kh&aacute;ch + bếp. - Dt 30-40m2- Gi&aacute; 3.200.000 đ- 4.000.000 đ/th&aacute;ng. - Nội thất: C&oacute; n&oacute;ng lạnh, giường, tủ, kệ bếp, chậu rửa, thiết bị vệ sinh hiện đại, c&aacute;c ph&ograve;ng đều thiết kế c&oacute; cửa sổ th&ocirc;ng tho&aacute;ng. T&ograve;a nh&agrave; c&oacute; thang m&aacute;y, bảo vệ 24/24, an ninh đảm bảo, điện nước ổn định. - Vị tr&iacute;: Nh&agrave; nằm ở khu vực đ&ocirc;ng d&acirc;n cư, d&acirc;n tr&iacute; cao, gần chợ, trường FPT, d&acirc;n lập L&ecirc; Q&uacute;y Đ&ocirc;n, mầm non hoa anh đ&agrave;o, s&aacute;t đ&ocirc; thị Mỹ Đ&igrave;nh &amp;#8230;, c&aacute;ch đường H&agrave;m Nghi 300m. Mặt đường trước cửa 5m, hai &ocirc; t&ocirc; tr&aacute;nh nhau, ph&ugrave; hợp người đi l&agrave;m, hộ gia đ&igrave;nh trẻ c&oacute; th&ecirc;m &ocirc;ng b&agrave; hoặc gi&uacute;p việc ở c&ugrave;ng. - G&iacute;a cả linh hoạt, thanh to&aacute;n tối thiểu 3 th&aacute;ng + cọc 1 th&aacute;ng. - Địa chỉ: Số nh&agrave; 118 Đường nguyễn Đổng Chi - Quận Nam Từ Li&ecirc;m. (si&ecirc;u thị th&agrave;nh đ&ocirc; rẽ v&agrave;o hoặc đường H&agrave;m Nghi đi v&agrave;o). Hoặc gần khu đ&ocirc; thị Mỹ Đ&igrave;nh 1 đi v&agrave;o.&lt;br /&gt;LI&Ecirc;N HỆ: CHỊ HƯƠNG 0978 335 871/ 0902 212 798 /0976 173 640', '740', null);
