INSERT INTO `contents` VALUES ('124', 'Chính chủ cho thuê phòng (Quận Thanh Xuân, quận Hà Đông)', '2 triệu 500 nghìn', '[\"1e762c59cebe43e78efae75ffc6f03b1.jpg\"]', ' Nguyễn Trãi, Phường Thanh Xuân Nam, Quận Thanh Xuân, Hà Nội', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 2 triệu 500 ngh&igrave;n&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 20 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 18/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2405814&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', 'Gia đ&igrave;nh m&igrave;nh cần cho thu&ecirc; 01 ph&ograve;ng trọ (tầng 3):&lt;br /&gt;-&amp;#9;01 ph&ograve;ng rộng 20m2, nh&agrave; vệ sinh ri&ecirc;ng, ban c&ocirc;ng tho&aacute;ng m&aacute;t, c&oacute; chỗ nấu ăn. B&igrave;nh nước n&oacute;ng, m&aacute;y giặt, m&aacute;y lọc nước uống&lt;br /&gt;-&amp;#9;Chỉ cho nữ thu&ecirc;.&lt;br /&gt;-&amp;#9;An ninh rất tốt, điện nước theo đồng hồ ri&ecirc;ng (Theo gi&aacute; của hộ gia đ&igrave;nh), internet miễn ph&iacute;.&lt;br /&gt;-&amp;#9;Nh&agrave; ngay giữa chợ, ng&otilde; rộng, thuận tiện ra c&aacute;c trường: ĐH H&agrave; Nội, ĐH KH X&atilde; hội v&agrave; Nh&acirc;n văn, ĐH KH Tự nhi&ecirc;n, Bưu ch&iacute;nh Viễn th&ocirc;ng&amp;#8230;&lt;br /&gt;-&amp;#9;Rất thuận tiện đi xe BUS. Đi ra đường Nguyễn Tr&atilde;i 400m (Ng&otilde; 475 Nguyễn Tr&atilde;i), ra đường Nguyễn Xiển 100m (Ng&otilde; 74 Nguyễn Xiển).&lt;br /&gt;-&amp;#9;Chủ nh&agrave; th&acir