INSERT INTO `contents` VALUES ('128', 'Cần vốn làm ăn. Bán nhanh 300m2 giá hữu nghị. Đất có sổ hồng, TC 100%', '365 triệu', '[\"c1d2e2a9ba5b4e55bf2b278f47d1edb6.jpg\",\"fc3886cc449f419ea9ebe6a8bba310f5.jpg\",\"f834937c0edc446ab90b5dda1e571160.jpg\",\"ce185a2899cd4ff49ac18398db47de13.jpg\"]', ' Đại Lộ Bình Dương, Thị Xã Bến Cát, Bình Dương', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 365 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 300 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: 300 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2370780&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ hồng&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Nam&lt;/li&gt; &lt;/ul&gt; ', 'Cần vốn nhập l&ocirc; h&agrave;ng cuối năm. N&ecirc;n b&aacute;n nhanh v&agrave;i l&ocirc; đất gi&aacute; hữu nghị.&lt;br /&gt;&lt;br /&gt;- 150m2 đường nhựa 16m gi&aacute; 365 triệu.&lt;br /&gt;&lt;br /&gt;- 150m2 s&aacute;t chợ gi&aacute; 510 triệu.&lt;br /&gt;&lt;br /&gt;- 300m2 g&oacute;c 2 mặt tiền đường nhựa (cả 2 mặt tiền đều đường nhựa 16m) gi&aacute; 1.200 triệu&lt;br /&gt;&lt;br /&gt;- 150m2 gần trường đại học gi&aacute; 430 triệu.&lt;br /&gt;&lt;br /&gt;Tất cả vị tr&iacute; đều c&oacute; sổ hồng, thổ cư đủ 100%.&lt;br /&gt;&lt;br /&gt;D&acirc;n cư đ&ocirc;ng đ&uacute;c, gần chợ v&agrave; trường học n&ecirc;n thuận tiện l&agrave;m ăn.&lt;br /&gt;&lt;br /&gt;Đặc biệt liền kề cụm KCN lớn đang c&ograve;n mở rộng quy m&ocirc; n&ecirc;n th&iacute;ch hợp đầu tư sinh lời.&lt;br /&gt;&lt;br /&gt;Ai c&oacute; nhu cầu th