INSERT INTO `contents` VALUES ('129', 'Kẹt tiền sang 600m2 cụm KCN Nhât_ Hàn_ Đài Loan,dân cư đông 375 tr/ n', '275 triệu', '[\"784199507eb14b188e627da0d945463b.jpg\",\"8fdd8ab308a048888d4e5217937a0727.jpg\"]', ' Tân Đông Hiệp - Tân Bình, Xã Đông Hoà, Thị Xã Dĩ An, Bình Dương', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 275 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: 300 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2359808&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ hồng&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', 'Vợ chồng kẹt tiền b&aacute;n gấp l&ocirc; đất 600m2 (20m x 30m) đất thổ cư, khu chợ, gần trường học, s&aacute;t b&ecirc;n KCN Nhật &amp;#8211; H&agrave;n &amp;#8211; Đ&agrave;i Loan, d&acirc;n cư đ&ocirc;ng đ&uacute;c.&lt;br /&gt;&lt;br /&gt;&amp;gt;&amp;gt; 0906 707 129 Chị V&acirc;n &lt;br /&gt;&lt;br /&gt;&amp;#8211; Đất thị x&atilde; cần tiền gấp n&ecirc;n sang gi&aacute; rẻ.&lt;br /&gt;&amp;#8211; Gi&aacute; b&aacute;n: Chỉ 375 triệu/nền (5x30m) (bao sang t&ecirc;n, c&ocirc;ng chứng). Ai mua hết 600m2 gi&aacute; c&ograve;n thương lượng cho ai thiện ch&iacute;&lt;br /&gt;=&amp;gt; Ph&aacute;p l&yacute;: Sổ hồng ri&ecirc;ng, minh bạch, r&otilde; r&agrave;ng. Đất ch&iacute;nh chủ,thổ cư 100%.&lt;br /&gt;&lt;br /&gt;- Sang t&ecirc;n chuyển nhượng tại ph&ograve;ng c&ocirc;ng chứng Tỉnh B&igrave;nh Dương. Nhận sổ hồng trong v&ograve;ng 7 ng&agrave;y.&lt;br /&gt;&lt;br /&gt;&lt;br /&gt;&amp