INSERT INTO `contents` VALUES ('137', 'Đất nền ven sông - KĐT River View mở bán 21/1, ck 15%', '460 triệu', '[\"b106d1b58de146d1b93b41cd2e0465b2.jpg\"]', ' Trường Sa, Quận Ngũ Hành Sơn, Đà Nẵng', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 460 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: 100 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 22/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2406212&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Hợp đồng mua b&aacute;n&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', 'Khu đ&ocirc; thị River View sở hữu vị tr&iacute; đắc địa, nằm gần trục đường du lịch biển Trường Sa, gần c&aacute;c b&atilde;i tắm Thống Nhất, H&agrave; My. &lt;br /&gt;Chủ đầu tư: C&ocirc;ng ty TNHH Thương mại v&agrave; Dịch vụ An Dương. &lt;br /&gt;C&ocirc;ng ty hợp t&aacute;c: C&ocirc;ng ty Cổ phần Địa ốc First Real. &lt;br /&gt;Đơn vị ph&acirc;n phối: C&ocirc;ng ty Bất động sản Protech. &lt;br /&gt;Vị tr&iacute; KĐT River View: &lt;br /&gt;- Ph&iacute;a Đ&ocirc;ng gi&aacute;p: S&ocirc;ng Cổ C&ograve; - Tuyến du lịch sinh th&aacute;i dưới nước Đ&agrave; Nẵng - Hội An. &lt;br /&gt;- Ph&iacute;a T&acirc;y gi&aacute;p: Liền kề trường học v&agrave; UBND. &lt;br /&gt;- Ph&iacute;a Nam: Khu đ&ocirc; thị Ph&uacute;c Vi&ecirc;n. &lt;br /&gt;- Ph&iacute;a Bắc: Gi&aacute;p đường 33m An Dương Vương (đi Hội An). &lt;br /&gt;- C&aacute;ch c&aacute;c b&atilde;i tắm top 10 Ch&acirc;u &Aacute; H&agrave; Mỹ, Thống Nhất: 800m. &lt;br /&gt;- C&aacute;ch b&atilde;i tắm v&agrave; c&ocirc;ng vi&ecirc;n biển Vi&ecirc;m Đ&ocirc;ng: 2,5km. &lt;br /&gt;- C&aacute;ch trung t&acirc;m Đ&agrave; Nẵng: 15 ph&uacute;t đi xe. &lt;br /&gt;- Ngay trung t&acirc;m phường Điện Dương, Điện B&agrave;n, Quảng Nam. &lt;br /&gt;- C&aacute;ch biển Cửa Đại: 9km. &lt;br /&gt;- C&aacute;ch Hội An: 8km. &lt;br /&gt;Sản phẩm KĐT River View: &lt;br /&gt;- Diện t&iacute;ch đất nền biệt thự: 200m2 đến 400m2,... &lt;br /&gt;- Diện t&iacute;ch đất nền: 90m2, 100m2, 120m2, 150m2,... &lt;br /&gt;- Đường: 13m5, 15m5, 17m5, 20m5. &lt;br /&gt;- Ph&aacute;p l&yacute; ho&agrave;n chỉnh, r&otilde; r&agrave;ng, hợp lệ.', '794', null);
