INSERT INTO `contents` VALUES ('144', 'Đất nền biệt thự nghỉ dưỡng cao cấp view sông, cách biển 300m', '3 tỷ 640 triệu', '[\"6e0844942b9e48bc88c67c4be5880440.jpg\",\"5c55e184a4404475a10186df978a4cd8.jpg\",\"6350e058b92a454296cef3a303d0af9a.jpg\"]', ' Trường Sa, Quận Ngũ Hành Sơn, Đà Nẵng', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 3 tỷ 640 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 250 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: 250 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2364359&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ hồng&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: T&acirc;y Nam&lt;/li&gt; &lt;/ul&gt; ', 'L&yacute; giải v&igrave; sao KĐT nghỉ dưỡng Ngọc Dương Reverside hấp dẫn nh&agrave; đầu tư?&lt;br /&gt;1. Vị tr&iacute; ưu Việt chưa từng c&oacute; trong ph&acirc;n kh&uacute;c BĐS nghỉ dưỡng.&lt;br /&gt;&amp;#8226; Nằm trải d&agrave;i tr&ecirc;n s&ocirc;ng Cổ C&ograve; c&oacute; bến du thuyền, 800m mặt s&ocirc;ng, c&aacute;ch b&atilde;i tắm c&ocirc;ng cộng Vi&ecirc;m Đ&ocirc;ng 300m, kh&iacute; hậu tho&aacute;ng m&aacute;t, l&agrave; nơi l&yacute; tưởng cho đầu tư nghỉ dưỡng.&lt;br /&gt;&amp;#8226; Liền kề c&aacute;c c&ocirc;ng tr&igrave;nh đẳng cấp 5 sao như CoCoBay, resort s&ocirc;ng H&agrave;n, s&acirc;n golf, Casino, biệt thự ven biển...&lt;br /&gt;Khi hạ tầng ho&agrave;n thiện th&igrave; khả năng tăng gi&aacute; sẽ cao.&lt;br /&gt;&lt;br /&gt;2. Chủ đầu tư uy t&iacute;n.&lt;br /&gt;&amp;#8226; Chủ đầu tư tập đo&agrave;n Đất Quảng.&lt;br /&gt;&amp;#8226; Cơ sở hạ tầng lu&ocirc;n thực hiện theo đ&uacute;ng tiến độ, b&agrave;n giao ho&agrave;n thiện, điện nước tận nền.&lt;br /&gt;3. Ph&aacute;p l&yacute;:&lt;br /&gt;Sổ đỏ vĩnh viễn ri&ecirc;ng từng nền &lt;br /&gt;4. Gi&aacute;:&lt;br /&gt;* Diện t&iacute;ch:&lt;br /&gt;L&ocirc; bi&ecirc;̣t thự: 250 m2.&lt;br /&gt;- Đường 10.5m giá: 14,7 tr - 15,2 tri&ecirc;̣u/m2.&lt;br /&gt;Gi&aacute; gốc từ chủ đầu tư&lt;br /&gt;Chi&ecirc;́t kh&acirc;́u cao l&ecirc;n đ&ecirc;́n 600 tri&ecirc;̣u.', '801', null);
