INSERT INTO `contents` VALUES ('157', 'Bán nhà 40m2 chợ Lũng Đông giá 750 triệu', '750 triệu', '[\"5d888a81ac824f9280a4ca9489eee8a3.jpg\",\"ebb8963829174336a6fb4b504448b16c.jpg\",\"fa9a13713e5a4cd6a88d954fad0cfbc9.jpg\",\"eba1c3401e34435681b31e684c4da942.jpg\",\"fb78545d6b104d7c92a00c92d20b545e.jpg\",\"afc96c041f6f4768998d5bb4910789ce.jpg\",\"e9d1ee5bddbe4c63bfb4093178bee22d.jpg\",\"23cb85ca07a148a3a59d28c84dc0d0ff.jpg\",\"3a30b76555ae49ca9a2779b845104e72.jpg\",\"fac20819634d424ca71d1964f35d0d85.jpg\",\"a47a3fee0ae14f71b79bc6010c2058b6.jpg\",\"0e861dcc9b814d8c8276123aab34c7a2.jpg\",\"aabceedc7ed54d298743fb16fd1feda8.jpg\",\"01f3fc02dea047fea1403139996f392b.jpg\",\"2feb91099e61485e8dc6dda09ea864b7.jpg\"]', ' Đằng Hải, Phường Đằng Hải, Quận Hải An, Hải Phòng', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 750 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 120 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: 40 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2241656&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: 3&lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: 2&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ hồng&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Đ&ocirc;ng Nam&lt;/li&gt; &lt;/ul&gt; ', 'B&aacute;n d&atilde;y nh&agrave; tại khu vực Chợ Lũng Đ&ocirc;ng bao gồm 10 căn&lt;br /&gt;&lt;br /&gt;C&oacute; 5 căn hướng Đ&ocirc;ng Nam v&agrave; 5 căn hướng T&acirc;y Bắc&lt;br /&gt;&lt;br /&gt;Gi&aacute; b&aacute;n 750tr/1 căn 2,5 tầng v&agrave; 800tr / 1 căn 3 tầng&lt;br /&gt;&lt;br /&gt;Thiết kế bao gồm 1 ph&ograve;ng kh&aacute;ch , 1 bếp , 2-3 ph&ograve;ng ngủ , 2 vệ sinh , 1 ph&ograve;ng thờ ,1 s&acirc;n phơi&lt;br /&gt;&lt;br /&gt;Ng&otilde; to &ocirc; t&ocirc; ra v&agrave;o thuận tiện&lt;br /&gt;&lt;br /&gt;Vị tr&iacute; ngay gần Chợ Lũng Đ&ocirc;ng , trường cấp 1 cấp 2 đằng hải , cảng đ&igrave;nh vũ , BigC vv..&lt;br /&gt;&lt;br /&gt;Hỗ trợ vay vốn ng&acirc;n h&agrave;ng khi mua nh&agrave; tối đa được 80% gi&aacute; trị t&agrave;i sản ( kh&ocirc;ng cần bảng lương )&lt;br /&gt;&lt;br /&gt;Cam kết bảo h&agrave;nh 10 năm về chất lượng c&ocirc;ng tr&igrave;nh cho c&aacute;c vấn đề kh&ocirc;ng may xảy ra v&iacute; dụ như ngấm gi&aacute;p ranh , thấm m&aacute;i , hoặc thấm vệ sinh bảo h&agrave;nh ho&agrave;n to&agrave;n miễn ph&iacute;&lt;br /&gt;&lt;br /&gt;C&aacute;c thiết bị điện v&agrave; thiết bị vệ sinh được bảo h&agrave;nh 1-5 năm t&ugrave;y theo h&atilde;ng sản xuất ( h&atilde;ng sản xuất kh&aacute;ch h&agrave;ng c&oacute; thể lựa chọn khi mua nh&agrave; )&lt;br /&gt;&lt;br /&gt;Kh&aacute;ch h&agrave;ng đi xem nh&agrave; n&ecirc;n mời thầy phong thủy hoặc kiến tr&uacute;c sư đi c&ugrave;ng để c&oacute; thể y&ecirc;n t&acirc;m hơn về t&acirc;m linh cũng như chất lượng c&ocirc;ng tr&igrave;nh do ch&uacute;ng t&ocirc;i x&acirc;y dựng&lt;br /&gt;&lt;br /&gt;Li&ecirc;n hệ ch&iacute;nh chủ mr Minh : 0932684078', '858', null);
INSERT INTO `contents` VALUES ('158', 'Bán nhà xây mới 3 tầng tại Quận Hải An, Hải Phòng, giá 860 triệu.', '860 triệu', '[\"d68d49945e3d4cd7b0a84819a2d5a925.jpg\",\"09c9801c9f8643de96c29118f5562fa5.jpg\",\"91eab39412b24a7aa099759e6a391c28.jpg\",\"a3cb6e8c64784840afbff7939b702be6.jpg\",\"aa99c30d1e344d0e9a7e6a73a6a326f9.jpg\",\"199ea88562ea4dabacb392350752247e.jpg\",\"a215a03714264cdc96c5e60d8ea335f2.jpg\"]', ' Đằng Hải, Phường Đằng Hải, Quận Hải An, Hải Phòng', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 860 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 125 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: 40 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 22/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2378244&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: 3&lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: 2&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ đỏ&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', '&amp;#128678;DIỆN T&Iacute;CH mặt bằng 40.2m2, diện t&iacute;ch sử dụng 125m2. &amp;#128072;&lt;br /&gt; THIẾT KẾ : ph&ograve;ng kh&aacute;ch, bếp, ph&ograve;ng ngủ, ph&ograve;ng thờ, s&acirc;n phơi, 2 nh&agrave; vệ sinh.&lt;br /&gt; NỘI THẤT: Tủ gầm bếp c&aacute;nh gỗ, tủ treo gỗ, cửa cường lực, cửa cuốn, hệ thống đ&egrave;n Led sang trọng t&iacute;ch điện, trần thạch cao, b&igrave;nh tắm n&oacute;ng lạnh 30l, hệ thống nước n&oacute;ng lạnh, bồn nước 300l. D&acirc;y chờ truyền h&igrave;nh c&aacute;p, internet l&ecirc;n đến tầng 3, hợp đồng điện nước ri&ecirc;ng biệt, c&aacute;c thiết bị điện v&agrave; thiết bị vệ sinh được bảo h&agrave;nh 1 - 5 năm t&ugrave;y theo h&atilde;ng sản xuất.&lt;br /&gt; KẾT CẤU: 3 tầng, khung cứng chịu lực, dầm kh&oacute;a m&oacute;ng, th&eacute;p Việt &Uacute;c, đ&aacute; ốp M&ocirc;ng Cổ, đường cấp nước n&oacute;ng lạnh l&agrave; ống h&agrave;n nhiệt, d&acirc;y điện 2x4, sơn b&oacute;ng kết hợp sơn mịn, c&aacute;t Vĩnh Ph&uacute;.&lt;br /&gt; PHONG THỦY &amp;#8211; T&Acirc;M LINH: Địa thế khu đất l&agrave;nh ( đất thổ l&acirc;u năm, đất trồng c&acirc;y, trồng hoa), phong thủy thiết kế hợp l&yacute;, đầy đủ c&aacute;c lễ (nhập trạch - động thổ - đổ m&oacute;ng - đổ m&aacute;i 1, 2, 3, 4 - ho&agrave;n long mạch) .&lt;br /&gt; &amp;#127989;CHẤT LƯỢNG NH&Agrave; BẢO H&Agrave;NH TRỌN G&Oacute;I 10 NĂM. &amp;#127989;&lt;br /&gt; &amp;#128680; &amp;#128680;SỔ ĐỎ. &amp;#128680; &amp;#128680;&lt;br /&gt; Hỗ trợ vay vốn ng&acirc;n h&agrave;ng tới 80% gi&aacute; trị nh&agrave; khi mua.', '859', null);
