INSERT INTO `contents` VALUES ('204', 'Cho thuê căn hộ full nội thất nhỏ 245 Bùi Đình Túy, quận Bình Thạnh,', '5 triệu', '[\"bf53879e8f6f444eb1275cbdab1a360c.jpg\"]', ' Bùi Đình Túy, Quận Bình Thạnh, TP.HCM', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 5 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 42 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2384908&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', '&amp;#10003;&amp;#10003;&amp;#10003; Ch&iacute;nh chủ cần cho căn hộ nhỏ full nội thất,Chu Văn An,quận B&Igrave;NH THẠNH&lt;br /&gt;&amp;#10003;&amp;#10003;&amp;#10003;Diện t&iacute;ch sử dụng của căn hộ l&agrave; 45m2,c&oacute; g&aacute;c,&lt;br /&gt;&amp;#10003;&amp;#10003;&amp;#10003; nội thất gồm: m&aacute;y lạnh,tủ lạnh,m&aacute;y nước n&oacute;ng lạnh, giường nệm chăn ga gối, kệ bếp ,bồn rửa,nh&agrave; vệ sinh cao cấp v&agrave; hệ thống chống ch&aacute;y nổ n&ecirc;n rất ăn to&agrave;n.&lt;br /&gt;&amp;#10003;&amp;#10003;&amp;#10003; Những nội thất kể tr&ecirc;n cam kết đều c&oacute; đủ &lt;br /&gt;&amp;#10003;&amp;#10003;&amp;#10003; Khu căn hộ an ninh bảo vệ 24/24,c&oacute; camera, c&oacute; thang m&aacute;y, c&oacute; dịch vụ giặt sấy,c&oacute; s&acirc;n thượng tho&aacute;ng m&aacute;t rộng r&atilde;i, giờ giấc tự do...&lt;br /&gt;&amp;#10003;&amp;#10003;&amp;#10003;Đặc Biệt: miễn ph&iacute; wifi,c&aacute;p TV, dịch vụ vệ sinh h&agrave;nh lang,thang m&aacute;y,bảo vệ 24/24,bảo tr&igrave; v&agrave; sửa tất cả c&aacute;c thiết bị trong ph&ograve;ng nếu c&oacute; chục chặc,tất cả đều miễn ph&iacute;.&lt;br /&gt;&amp;#10003;&amp;#10003;&amp;#10003;gần c&aacute;c trường đại học như &amp;#10003;&amp;#10003;&amp;#10003;Hutech,UEF,GTVT,Ngoại Thương, C&ocirc;ng Nghiệp 4,T&ocirc;n Đức Thắng,đại học Quốc tế hồng b&agrave;ng,v&agrave; c&ograve;n rất nhiều trường kh&aacute;c cũng như gần c&aacute;c khu trung t&acirc;m thương mại lớn nhất s&agrave;i g&ograve;n,v&agrave; dễ d&agrave;ng lưu th&ocirc;ng qua c&aacute;c quận...&lt;br /&gt;&amp;#10003;&amp;#10003;&amp;#10003;nay m&igrave;nh cho thu&ecirc; với gi&aacute; chỉ 5tr/th ,nhấc m&aacute;y ngay v&agrave; gọi cho m&igrave;nh để xem căn hộ ạ,cảm ơn c&aacute;c bạn đ&atilde; đọc tin ạ !', '1020', null);
