INSERT INTO `contents` VALUES ('220', 'Chính chủ bán hoặc cho thuê nhà hẻm xe hơi 134 Thành Thái P.12 Quận 10', '10 tỷ 500 triệu', '[\"68e03e3a1261478baaedb8ed5e5a4268.jpg\"]', ' Thành Thái, Phường 12, Quận 10, TP.HCM', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 10 tỷ 500 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: 76 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2309282&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: 10&lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: 5&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ hồng&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: T&acirc;y Bắc&lt;/li&gt; &lt;/ul&gt; ', 'Ch&iacute;nh chủ b&aacute;n hoặc cho thu&ecirc; nh&agrave; hẻm xe hơi 134 Th&agrave;nh Th&aacute;i ,Phường 12 Quận 10.&lt;br /&gt;- Diện t&iacute;ch: (4.2 x 18m) vu&ocirc;ng vức, DTSD 225 m2. Trệt + lửng suốt + 2 lầu s&acirc;n thượng.&lt;br /&gt;- Vị tr&iacute; trung t&acirc;m Quận 10, Hẻm trước nh&agrave; 8m, 2 xe hơi tr&aacute;nh nhau, hẻm th&ocirc;ng tho&aacute;ng giao th&ocirc;ng thuận tiện, c&aacute;ch mặt tiền đường kho&atilde;ng 50m. Khu nội sang trọn, rất thuận tiện để ở v&agrave; mở văn ph&ograve;ng c&ocirc;ng ty, mở kh&aacute;ch sạn, spa&amp;#8230;Hiện đang cho thu&ecirc; 25 triệu/th&aacute;ng (gần hết hợp đồng).&lt;br /&gt;- Nay cần b&aacute;n gi&aacute;: 10.5 tỷ ( c&ograve;n thương lượng). Hoặc cho thu&ecirc; nguy&ecirc;n căn : 25 triệu/ th&aacute;ng.&lt;br /&gt;- Ph&aacute;p l&yacute; sổ hồng ch&iacute;nh chủ.&lt;br /&gt;- Li&ecirc;n hệ ch&iacute;nh chủ: Đỗ T&acirc;n 0903633169', '1178', null);
INSERT INTO `contents` VALUES ('221', 'Nhà 1/ DS14 – Lê Văn Quới, 4x12m, hẻm ô tô tiện KD, gần bốn xã', '2 tỷ 650 triệu', '[\"9a44b811919a483883a7ad6ba2b156ce.jpg\"]', ' Lê Văn Quới, Phường Bình Hưng Hòa A, Quận Bình Tân, TP.HCM', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 2 tỷ 650 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: 48 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2389257&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: 2&lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: 2&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ hồng&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', 'Nh&agrave; c&oacute; diện t&iacute;ch: 4x12m, c&ocirc;ng nhận đủ, nh&agrave; cấp 4, 2PN, 2TL, bếp, v&agrave;o ở ngay được. Vị tr&iacute; đẹp, được x&acirc;y dựng tự do, c&oacute; thể x&acirc;y nh&agrave; cao tầng ở, kinh doanh&amp;#8230;&lt;br /&gt;Hẻm xe hơi hẻm 1 sẹc đường số 14, gần ngay L&ecirc; Văn Quới, từ nh&agrave; ra L&ecirc; Văn Quới khoảng 100m l&agrave; tới, gần ng&atilde; tư bốn x&atilde;, B&igrave;nh Trị Đ&ocirc;ng, Quận B&igrave;nh T&acirc;n.&lt;br /&gt;Gần chợ trường học, si&ecirc;u thị AEON, Auchan, hệ thống b&aacute;ch h&oacute;a xanh, ng&acirc;n h&agrave;ng, nh&agrave; h&agrave;ng, khu vui chơi đầy đủ tiện &iacute;ch.&lt;br /&gt;Đi Aeon B&igrave;nh t&acirc;n, bến xe Miền T&acirc;y, c&ocirc;ng viện đầm sen gần.&lt;br /&gt;Gi&aacute;: 2.65 tỷ c&ograve;n thương lượng, sổ hồng ri&ecirc;ng ch&iacute;nh chủ, bao sang t&ecirc;n, được hỗ trợ vay 70% vốn ng&acirc;n h&agrave;ng.&lt;br /&gt;Li&ecirc;n hệ xem nh&agrave; miễn ph&iacute; A T&ugrave;ng: 0939.530.580, mong gặp kh&aacute;ch thiện ch&iacute;, miễn trung gian!.', '1179', null);
INSERT INTO `contents` VALUES ('222', 'Bán nhà mặt tiền nội bộ Trần Nhật Duật, P.Tân Định, Quận 1.DT: 4,5x17', '14 tỷ 500 triệu', '[\"218f44a58e9f43149047f659ffa0b6fb.jpg\"]', ' Trần Nhật Duật, Phường Tân Định, Quận 1, TP.HCM', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 14 tỷ 500 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: 72 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2146470&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: 6&lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: 6&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ hồng&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: T&acirc;y Bắc&lt;/li&gt; &lt;/ul&gt; ', 'B&aacute;n nh&agrave; mặt tiền nội bộ đường (10m) Trần Nhật Duật, Phường t&acirc;n định Quận 1, gần Ho&agrave;ng Sa. &lt;br /&gt;&lt;br /&gt;- Diện t&iacute;ch: 4.5 x 17,5m, vu&ocirc;ng vức, kh&ocirc;ng lộ giới, sổ hồng ch&iacute;nh chủ.&lt;br /&gt;&lt;br /&gt; - Kết cấu: 1 trệt, 3 lầu đẹp, mua v&agrave;o ở ngay hoặc cho thu&ecirc; nguy&ecirc;n căn thu nhập cao.&lt;br /&gt; - Nh&agrave; ngay trung t&acirc;m Quận 1, khu vực nh&agrave; sang trọng, d&acirc;n tr&iacute; cao, cực kỳ an ninh, xung quanh đầy đủ tiện &iacute;ch: Bệnh viện, chợ, trường học, si&ecirc;u thị, nhiều cao ốc văn ph&ograve;ng c&ocirc;ng ty, tiện mở Spa, l&agrave;m thậm mỹ viện, văn ph&ograve;ng c&ocirc;ng ty.&lt;br /&gt;&lt;br /&gt; - Gia đ&igrave;nh cần b&aacute;n nhanh gi&aacute; chỉ 14.5 tỷ thương lượng. &lt;br /&gt;- Hotline:Xu&acirc;n Ho&agrave;ng 0902.705.333. Cam kết th&ocirc;ng tin ch&iacute;nh x&aacute;c 100%.', '1180', null);
INSERT INTO `contents` VALUES ('223', 'Sang 600m lô góc ngã tư đường nhựa ngay chợ tiện kinh doanh giá 3tr/m2', '450 triệu', '[\"d078023e1b9f4ec79e673947a37c121a.jpg\",\"4190e82eeaf84808b2d606894d04bd5d.jpg\"]', ' Quốc Lộ 13, Phường An Phú, Thị xã Thuận An, Bình Dương', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 450 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: 600 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2357648&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ hồng&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', '- T&ocirc;i c&oacute; l&ocirc; đất ngay ng&atilde; tư g&oacute;c 2 mặt tiền 600m2( 20x30 ) nằm đối diện chợ liền kề Tp B&igrave;nh Dương mua năm 2009 để sau n&agrave;y l&agrave;m nh&agrave; h&agrave;ng. Nay do gia đ&igrave;nh chuyển định cư cần b&aacute;n lỗ gấp cho ai c&oacute; nhu cầu kinh doanh, bu&ocirc;n b&aacute;n,x&acirc;y trọ&lt;br /&gt;- KCN nhẹ kh&ocirc;ng kh&oacute;i,kh&ocirc;ng tiếng ồn c&aacute;ch ra 500m,đối diện trước nh&agrave; l&agrave; chợ,trường1,2 thuận tiện con c&aacute;i ăn học,mua b&aacute;n kinh doanh hay x&acirc;y cho thu&ecirc; ph&ograve;ng trọ&lt;br /&gt;Diện t&iacute;ch: 600m2 (20x30) 4 sổ ri&ecirc;ng.&lt;br /&gt;Gi&aacute; b&aacute;n chỉ: 3 triệu /m2 (bao sang t&ecirc;n, c&ocirc;ng chứng).&lt;br /&gt;Đất đ&atilde; c&oacute; sổ hồng ri&ecirc;ng, ch&iacute;nh chủ, thổ cư 100%. Mặt tiền đường nhựa 18m, th&ocirc;ng d&agrave;i.&lt;br /&gt;&lt;br /&gt;X&acirc;y dựng tự do,đ