INSERT INTO `contents` VALUES ('232', 'Bán gấp dãy trọ mới xây 800tr , ngay cụm KCN , SHR,BST', '800 triệu', '[\"f3e31a4423df4ede96791bdee6db0a61.jpg\",\"9485b57a6d0a4808a86b1c66f7c3a8e3.jpg\",\"9036b954f7b04042afba19f654ca3f73.jpg\"]', ' Quốc Lộ 1A, Xã Bình Chánh, Huyện Bình Chánh, TP.HCM', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 800 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 250 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: 250 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 22/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2405546&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: 12&lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: 12&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ hồng&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Đ&ocirc;ng Nam&lt;/li&gt; &lt;/ul&gt; ', 'D&atilde;y trọ mới x&acirc;y, cạnh 4 KCN lớn. Gần chợ, trường, trung t&acirc;m.X&acirc;y được 12 ph&ograve;ng, c&oacute; 2 ki ốt mặt tiền đường nhựa 18m sạch sẽ, cống nước đầy đủ.DT: 10x25= 250m2. B&aacute;n 800 trc&oacute; thương lượng.Nằm s&aacute;t b&ecirc;n đường li&ecirc;n cụm khu c&ocirc;ng nghiệp 40m, đ&atilde; ho&agrave;n thiện. Nh&agrave; trọ đ&atilde; c&oacute; kh&aacute;ch ở đầy hết ph&ograve;ng.Sổ hồng ri&ecirc;ng, sang t&ecirc;n liền v&agrave; đưa lu&ocirc;n giấy ph&eacute;p kinh doanh, xin gi&ugrave;m tạm tr&uacute; cho kh&aacute;ch mới.Thu nhập trung b&igrave;nh 12 triệu / th&aacute;ng, cao hơn l&atilde;i suất ng&acirc;n hang hiện tại. &lt;br /&gt;Li&ecirc;n hệ: 0901297400 CHỊ THẢO', '1190', null);
INSERT INTO `contents` VALUES ('233', 'Bán nhà 4 tấm Lê Văn Quới, rộng 5m dài 11m, 3.4 tỷ, hẻm ô tô đẹp', '3 tỷ 400 triệu', '[\"d958721d64044eacab262aa818cb097d.jpg\",\"7a68483a15874d819a1b16fa4a984c6e.jpg\"]', ' Lê Văn Quới, Phường Bình Trị Đông, Quận Bình Tân, TP.HCM', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 3 tỷ 400 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: 55 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2386228&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: 5&lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: 5&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ hồng&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Kh&ocirc;ng x&aacute;c định&lt;/li&gt; &lt;/ul&gt; ', 'Nh&agrave; quận b&igrave;nh t&acirc;n mới đẹp, thiết kế kiểu hiện đại, sang trọng, lịch l&atilde;m, sổ hồng ri&ecirc;ng giấy tờ đầy đủ, nh&agrave; ở mặt tiền hẻm &ocirc; t&ocirc; đường L&ecirc; Văn Quới, c&oacute; chỗ đậu xe &ocirc; t&ocirc;, gần đường B&igrave;nh Trị Đ&ocirc;ng, v&ograve;ng xoay Ph&uacute; L&acirc;m, ng&atilde; tư Bốn X&atilde;.&lt;br /&gt;Nh&agrave; gồm 4 tấm, đ&uacute;c thật ki&ecirc;n cố.&lt;br /&gt;Diện t&iacute;ch: 5x11m gồm 5 ph&ograve;ng ngủ, 1 ph&ograve;ng kh&aacute;ch, toilet ri&ecirc;ng mỗi ph&ograve;ng, 1 ph&ograve;ng thờ, 1 bếp, trang bị đầy đủ c&aacute;c vật dụng cần thiết như: Tủ kệ bếp tr&ecirc;n dưới, bồn rửa ch&eacute;n, bồn rửa tay, quạt, điện, c&aacute;p, m&aacute;y nước n&oacute;ng, quạt th&ocirc;ng gi&oacute;, tường nh&agrave; ốp gạch cao với nhiều hoa văn được trang tr&iacute; tinh xảo, nội thất cao cấp, cầu thang đ&uacute;c k&iacute;nh cường lực, nền gạch men cao cấp, cửa nh&agrave; 3 lớp an to&agrave;n c&oacute; cửa k&iacute;nh, cửa cuốn&amp;#8230;.&lt;br /&gt;Vị tr&iacute; nh&agrave; mặt tiền hẻm xe hơi qua lại thoải m&aacute;i, đường th&ocirc;ng tho&aacute;ng, khu d&acirc;n cư đ&ocirc;ng đ&uacute;c, an ninh, tiện ở tiện kinh doanh&amp;#8230; gần chợ, gần trường học, gần si&ecirc;u thị Aeon, gần bệnh viện, gần khu vui chơi trẻ em, tiện đi lại c&aacute;c hướng, tiện đi về Quận 6, Quận 5, Quận 11.&lt;br /&gt;Gi&aacute;: 3.4 tỷ c&ograve;n thương lượng.&lt;br /&gt;LH: 0932.190.633 (C Hương, MTG)', '1191', null);
