INSERT INTO `contents` VALUES ('246', 'Nhà Phan Xích Long - Phùng Văn Cung, 41,3m2, Giá: 5.43 tỷ P 7, PN.', '5 tỷ 430 triệu', '[\"c21bed95229e40a982176a7379daf8e3.jpg\",\"5a7aa9c9225d49c2b7b67b9ecb9c0572.jpg\"]', ' Phùng Văn Cung, Quận Phú Nhuận, TP.HCM', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 5 tỷ 430 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: 41,3 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: 41,3 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2383387&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: 5&lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: 5&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ hồng&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Đ&ocirc;ng&lt;/li&gt; &lt;/ul&gt; ', 'Nhanh tay nh&eacute; Qu&yacute; Kh&aacute;ch chỉ c&oacute; một căn duy nhất.&lt;br /&gt;Ngang: 3,53m.&lt;br /&gt;D&agrave;i: 13m.&lt;br /&gt;Nh&agrave; trong khu vực an ninh, khu vừa ở vừa kinh doanh, vị tr&iacute; nh&agrave; đẹp thuận tiện giao th&ocirc;ng gần c&aacute;c tiện &iacute;ch : chợ, trường học, bệnh viện, khu thể thao, si&ecirc;u thị, trường ngoại ngữ ILA, VUS...Nh&agrave; thiết kế đẹp, th&ocirc;ng tho&aacute;ng.&lt;br /&gt;Ph&ograve;ng kh&aacute;ch đẹp, bếp xinh xắn, &lt;br /&gt;Ph&ograve;ng tắm trong mỗi ph&ograve;ng với đầy đủ trang thiết bị. Nh&agrave; hướng Đ&ocirc;ng Bắc, sổ hồng, &lt;br /&gt;Nh&agrave; 5 lầu x&acirc;y mới x&aacute;ch va li v&agrave;o ở. ch&igrave;a kh&oacute;a trao tay, xem ngay mọi l&uacute;c.&lt;br /&gt;Hẻm oto , xe tải.&lt;br /&gt;Hướng nh&agrave; m&aacute;t mẻ bao người m&ecirc;.&lt;br /&gt;Nh&igrave;n v&ocirc; l&agrave; th&iacute;ch ngay.&lt;br /&gt;T&ocirc;i sẽ hỗ trợ bạn để thương lượng v&agrave; c&oacute; gi&aacute; tốt nhất, b&ecirc;n mua ho&agrave;n to&agrave;n kh&ocirc;ng mất ph&iacute;, được tư vấn hỗ trợ ph&aacute;p l&yacute;, hợp đồng 24/24.&amp;#160;&lt;br /&gt;Ch&uacute;ng t&ocirc;i hiện đang sở hữu kho dữ liệu nh&agrave; đất thổ cư lớn nhất TP HCM với mọi mức gi&aacute; v&agrave; được cập nhật li&ecirc;n tục. Qu&yacute; kh&aacute;ch quan t&acirc;m, vui l&ograve;ng li&ecirc;n hệ: Đ&ecirc;m BĐS (miễn trung gian)', '1222', null);
