INSERT INTO `contents` VALUES ('251', 'Cần tiền làm ăn bán gấp nhà HXH Nhất Chi Mai, DT: 4x20, 4 tầng, 7.5 tỷ', '7 tỷ 500 triệu', '[\"312074be1b3941bf9c4127314605d784.jpg\"]', ' Nhất Chi Mai, Quận Tân Bình, TP.HCM', ' &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Gi&aacute;&lt;/span&gt;: 7 tỷ 500 triệu&lt;/li&gt; &lt;li&gt;&lt;span&gt;DT sử dụng&lt;/span&gt;: &lt;/li&gt; &lt;li&gt;&lt;span&gt;Diện t&iacute;ch đất&lt;/span&gt;: 80 m&lt;sup&gt;2&lt;/sup&gt;&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ng&agrave;y đăng&lt;/span&gt;: 23/01/2018&lt;/li&gt; &lt;li class=&quot;last&quot;&gt;&lt;span&gt;M&atilde; BĐS&lt;/span&gt;: 2408676&lt;/li&gt; &lt;/ul&gt; &lt;ul class=&quot;property-info&quot;&gt; &lt;li&gt;&lt;span&gt;Ph&ograve;ng ngủ&lt;/span&gt;: 6&lt;/li&gt; &lt;li&gt;&lt;span&gt;Nh&agrave; tắm&lt;/span&gt;: 6&lt;/li&gt; &lt;li&gt;&lt;span&gt;Ph&aacute;p l&yacute;&lt;/span&gt;: Sổ hồng&lt;/li&gt; &lt;li class=&quot;lastest&quot;&gt;&lt;span&gt;Hướng&lt;/span&gt;: Đ&ocirc;ng&lt;/li&gt; &lt;/ul&gt; ', 'Cần tiền l&agrave;m ăn b&aacute;n gấp nh&agrave; HXH Nhất Chi Mai, DT: 4x20, 4 tầng, 7.5 tỷ:&lt;br /&gt;- Diện t&iacute;ch: 4m x 20m&lt;br /&gt;- Kết cấu: trệt, 3 lầu.&lt;br /&gt;- Nh&agrave; nằm ở khu vực y&ecirc;n tĩnh, an ninh, hẻm xe hơi v&ocirc; tới nh&agrave; th&ocirc;ng tho&aacute;ng, hẻm th&ocirc;ng đường Nhất Chi Mai v&agrave; L&ecirc; Văn Hu&acirc;n, nh&agrave; cực đẹp tiện để ở.&lt;br /&gt;- Gi&aacute; b&aacute;n: 7.5 tỷ (thương lượng kh&aacute;ch thiện ch&iacute;)&lt;br /&gt;- Hỗ trợ ph&aacute;p l&yacute;, hỗ trợ vay ng&acirc;n h&agrave;ng 80% gi&aacute; trị căn nh&agrave;.&lt;br /&gt;- Cam kết th&ocirc;ng tin ch&iacute;nh x&aacute;c 100%.&lt;br /&gt;NHẬN K&Yacute; GỬI MUA B&Aacute;N NH&Agrave; ĐẤT.&amp;#9;&lt;br /&gt;Điện thoại: 0914541133 &amp;#8211; Quốc (MIỄN TRUNG GIAN)&amp;#9;&lt;br /&gt;C&ocirc;ng ty Cổ phần Đầu tư Địa ốc Viễn Đ&ocirc;ng Land&amp;#9;&lt;br /&gt;Địa chỉ: 17 Đồng Xo&agrave;i, P.13, T&acirc;n B&igrave;nh, Tp.HCM&lt;br /&gt; ----